	VALUES (0, 'Jonathan_Joestar', 'Jonathan_Joestar@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Jonathan Joestar', 'Jonathan Joestar (ジョナサン・ジョースター, Jonasan Jōsutā) is the main protagonist of the first part of the JoJo''s Bizarre Adventure series, Phantom Blood, and the first JoJo of the series. His legacy extends throughout almost the entirety of the first six parts of the series, with major characters such as Joseph Joestar and Jotaro Kujo being his descendants.', TIMESTAMP WITH TIME ZONE '2019-07-17 23:07:00+00', 0.00::money, FALSE);
	VALUES (1, 'Will_Anthonio_Zeppeli', 'Will_Anthonio_Zeppeli@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Will Anthonio Zeppeli', 'Will Anthonio Zeppeli (ウィル・Ａ(アントニオ)・ツェペリ, Wiru Antonio Tseperi), also known as Baron Zeppeli (ツェペリ男爵, Tseperi Danshaku), is a primary ally featured in the first part of the JoJo''s Bizarre Adventure series, Phantom Blood.', TIMESTAMP WITH TIME ZONE '2018-11-06 08:02:34+00', 190.39::money, FALSE);
	VALUES (2, 'Robert_E._O._Speedwagon', 'Robert_E._O._Speedwagon@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Robert E. O. Speedwagon', 'Robert E. O. Speedwagon (ロバート・E・O・スピードワゴン, Robāto Ī Ō Supīdowagon) is a primary ally featured in the 1st part of the JoJo''s Bizarre Adventure series, Phantom Blood. Formerly a Londoner thug residing in Ogre Street, Speedwagon befriends Jonathan Joestar and becomes a loyal ally to his cause.', TIMESTAMP WITH TIME ZONE '2019-10-16 12:06:43+00', 123.99::money, TRUE);
	VALUES (3, 'Erina_Pendleton', 'Erina_Pendleton@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Erina Pendleton', 'Erina Pendleton (エリナ・ペンドルトン, Erina Pendoruton) is a secondary ally featured in the first part of the JoJo''s Bizarre Adventure series, Phantom Blood, as well as the second part, Battle Tendency.', TIMESTAMP WITH TIME ZONE '2021-02-18 15:35:30+00', 314.33::money, TRUE);
