	VALUES (6, 'Tonpetty', 'Tonpetty@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Tonpetty', 'Tonpetty (トンペティ, Tonpeti) is a tertiary ally featured in the first part of the JoJo''s Bizarre Adventure series, Phantom Blood. He is a Ripple master who trained Will Anthonio Zeppeli, later joining forces with Jonathan directly alongside his disciples Straizo and Dire.', TIMESTAMP WITH TIME ZONE '2019-02-27 20:59:49+00', 0.00::money, TRUE);
	VALUES (7, 'Straizo', 'Straizo@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Straizo', 'Straizo (ストレイツォ, Sutoreitso) is tertiary ally featured in the first part of the JoJo''s Bizarre Adventure series, Phantom Blood, and a secondary antagonist in the second part, Battle Tendency. ', TIMESTAMP WITH TIME ZONE '2018-05-07 02:03:24+00', 107.52::money, TRUE);
