	VALUES (9, 'Dio_Brando', 'Dio_Brando@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Dio Brando', 'Dio Brando (ディオ・ブランドー, Dio Burandō), later known simply as DIO (ＤＩＯ(ディオ)), is the main antagonist of the first and third parts of the JoJo''s Bizarre Adventure series, Phantom Blood and Stardust Crusaders, as well as a posthumous primary antagonist in the sixth part, Stone Ocean. His influence is felt throughout all of the first six parts of the series, with major characters such as Giorno Giovanna and Enrico Pucci being directly connected to him.', TIMESTAMP WITH TIME ZONE '2018-05-28 19:24:29+00', 102.13::money, FALSE);
