	VALUES (54, 'Lisa_Lisa', 'Lisa_Lisa@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Lisa Lisa', 'Lisa Lisa (リサリサ, Risa Risa), full name Elizabeth Joestar (エリザベス・ジョースター, Erizabesu Jōsutā), is a primary ally featured in the second part of the JoJo''s Bizarre Adventure series, Battle Tendency, but introduced in the first part, Phantom Blood.', TIMESTAMP WITH TIME ZONE '2020-09-17 02:28:33+00', 0.00::money, TRUE);
