Josuke Higashikata (東方 仗助, Higashikata Jōsuke) is the main protagonist of the fourth part of the JoJo''s Bizarre Adventure series, Diamond is Unbreakable, and the fourth JoJo of the series. He is the illegitimate son of Joseph Joestar and Tomoko Higashikata.', TIMESTAMP WITH TIME ZONE '2020-10-27 15:59:12+00', 297.53::money, TRUE);
	VALUES (225, 'Okuyasu_Nijimura', 'Okuyasu_Nijimura@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Okuyasu Nijimura', 'Okuyasu Nijimura (虹村 億泰, Nijimura Okuyasu) is a main ally featured in the fourth part of the JoJo''s Bizarre Adventure series, Diamond is Unbreakable.', TIMESTAMP WITH TIME ZONE '2018-04-15 07:35:00+00', 173.89::money, TRUE);
	VALUES (226, 'Koichi_Hirose', 'Koichi_Hirose@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Koichi Hirose', 'Koichi Hirose (広瀬 康一, Hirose Kōichi) is the deuteragonist of the fourth part of JoJo''s Bizarre Adventure, Diamond is Unbreakable. He also appears briefly as a minor ally in the fifth part, Vento Aureo, assisting Giorno Giovanna in the fight against Polpo''s Stand, Black Sabbath.', TIMESTAMP WITH TIME ZONE '2019-04-05 10:21:58+00', 206.97::money, TRUE);
	VALUES (227, 'Rohan_Kishibe', 'Rohan_Kishibe@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Rohan Kishibe', '
Rohan Kishibe (岸辺 露伴, Kishibe Rohan) is a main ally featured in the fourth part of the JoJo''s Bizarre Adventure series, Diamond is Unbreakable. First featured as an antagonist in the "Let''s Go to the Manga Artist''s House" story arc, he cooperates in the search for Yoshikage Kira.', TIMESTAMP WITH TIME ZONE '2020-10-12 19:59:50+00', 267.92::money, TRUE);
	VALUES (228, 'Hayato_Kawajiri', 'Hayato_Kawajiri@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Hayato Kawajiri', 'Hayato Kawajiri (川尻 早人, Kawajiri Hayato) is a major ally featured in the fourth part of JoJo''s Bizarre Adventure, Diamond is Unbreakable, playing a crucial role in the "My Dad Is Not My Dad" and "Crazy Diamond is Unbreakable story arcs.', TIMESTAMP WITH TIME ZONE '2020-05-23 09:36:46+00', 141.16::money, FALSE);
	VALUES (229, 'Reimi_Sugimoto', 'Reimi_Sugimoto@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Reimi Sugimoto', 'Reimi Sugimoto (杉本 鈴美, Sugimoto Reimi) is a major ally featured in the 4th part of JoJo''s Bizarre Adventure, Diamond is Unbreakable, introduced in the "Rohan Kishibe''s Adventure" story arc.', TIMESTAMP WITH TIME ZONE '2019-11-03 06:51:05+00', 357.23::money, FALSE);
	VALUES (230, 'Shigekiyo_Yangu', 'Shigekiyo_Yangu@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Shigekiyo Yangu', '
Shigekiyo Yangu (矢安宮 重清, Yangū Shigekiyo), nicknamed Shigechi (重ちー, Shigechī), is a side character featured in the fourth part of JoJo''s Bizarre Adventure, Diamond is Unbreakable, specifically in the "''Shigechi''s'' Harvest" and "Yoshikage Kira Just Wants to Live Quietly" story arcs.', TIMESTAMP WITH TIME ZONE '2018-09-17 15:26:21+00', 4.66::money, TRUE);
	VALUES (231, 'Mikitaka_Hazekura', 'Mikitaka_Hazekura@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Mikitaka Hazekura', 'Mikitaka Hazekura (支倉 未起隆, Hazekura Mikitaka), also self-proclaimed as Nu Mikitakazo Nshi (ヌ・ミキタカゾ・ンシ), is an ally featured in the 4th part of JoJo''s Bizarre Adventure, Diamond is Unbreakable, specifically in the "I''m an Alien" and "Let''s Live on a Transmission Tower" story arcs.', TIMESTAMP WITH TIME ZONE '2020-01-13 07:08:24+00', 354.05::money, TRUE);
	VALUES (232, 'Yukako_Yamagishi', 'Yukako_Yamagishi@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Yukako Yamagishi', 'Yukako Yamagishi (山岸 由花子, Yamagishi Yukako) is a side character featured in the fourth part of the JoJo''s Bizarre Adventure series, Diamond is Unbreakable. Introduced as a minor antagonist in the "Yukako Yamagishi Falls In Love" story arc, she becomes a neutral character in the "Yukako Yamagishi Dreams of Cinderella" arc. ', TIMESTAMP WITH TIME ZONE '2019-04-16 02:56:33+00', 14.98::money, TRUE);
	VALUES (233, 'Yuya_Fungami', 'Yuya_Fungami@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Yuya Fungami', 'Yuya Fungami (噴上 裕也, Fungami Yūya) is a minor character featured in the 4th part of JoJo''s Bizarre Adventure, Diamond is Unbreakable. Introduced as an antagonist in "Highway Star", he becomes an ally in "Enigma Boy".', TIMESTAMP WITH TIME ZONE '2018-01-10 01:21:00+00', 0.00::money, TRUE);
	VALUES (234, 'Tamami_Kobayashi', 'Tamami_Kobayashi@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Tamami Kobayashi', '
