Ermes Costello (エルメェス・コステロ, Erumēsu Kosutero), is a major ally featured in the sixth part of JoJo''s Bizarre Adventure, Stone Ocean.
Ermes is a woman voluntarily imprisoned in Green Dolphin Street Prison in order to seek revenge for her sister Gloria Costello''s killer, Sports Maxx, and soon allies herself with Jolyne Cujoh in the hostile environment that the jail is. Thanks to a certain pendant, Ermes acquires her own Stand, Kiss.', TIMESTAMP WITH TIME ZONE '2020-12-10 16:33:32+00', 349.65::money, TRUE);
