	VALUES (568, 'Yasuho_Hirose', 'Yasuho_Hirose@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Yasuho Hirose', 'Yasuho Hirose (広瀬 康穂, Hirose Yasuho) is the deuteragonist of the eighth part of the JoJo''s Bizarre Adventure series, JoJolion.', TIMESTAMP WITH TIME ZONE '2018-04-18 10:30:01+00', 36.18::money, TRUE);
