	VALUES (570, 'Norisuke_Higashikata_IV', 'Norisuke_Higashikata_IV@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Norisuke Higashikata IV', '
Norisuke Higashikata IV (四代目東方 憲助, Yondaime Higashikata Norisuke), born Josuke Higashikata (東方常助, Higashikata Jōsuke), is an ally featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion.', TIMESTAMP WITH TIME ZONE '2020-07-09 02:49:08+00', 132.77::money, TRUE);
	VALUES (571, 'Jobin_Higashikata', 'Jobin_Higashikata@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Jobin Higashikata', 'Jobin Higashikata (東方 常敏, Higashikata Jōbin) is a primary antagonist featured in the eighth part of the JoJo''s Bizarre Adventure series, JoJolion.', TIMESTAMP WITH TIME ZONE '2020-08-16 07:49:01+00', 0.00::money, TRUE);
	VALUES (572, 'Mitsuba_Higashikata', 'Mitsuba_Higashikata@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Mitsuba Higashikata', 'Mitsuba Higashikata (東方 密葉, Higashikata Mitsuba) is a secondary character featured in the eighth part of the JoJo''s Bizarre Adventure series, JoJolion. Gaining significance during the "Doctor Wu and Awaking 3 Leaves" story arc, she becomes a temporary ally to Yasuho Hirose.', TIMESTAMP WITH TIME ZONE '2018-04-01 18:55:40+00', 51.75::money, FALSE);
	VALUES (573, 'Tsurugi_Higashikata', 'Tsurugi_Higashikata@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Tsurugi Higashikata', 'Tsurugi Higashikata (東方 つるぎ, Higashikata Tsurugi) is a side character featured in the 8th part of JoJo''s Bizarre Adventure, JoJolion. Tsurugi cooperates with different factions during the course of the story.', TIMESTAMP WITH TIME ZONE '2020-12-12 10:21:23+00', 301.62::money, TRUE);
	VALUES (574, 'Joshu_Higashikata', 'Joshu_Higashikata@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Joshu Higashikata', 'Joshu Higashikata (東方 常秀, Higashikata Jōshū) is a side character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion.', TIMESTAMP WITH TIME ZONE '2020-09-26 02:03:14+00', 0.00::money, TRUE);
	VALUES (575, 'Hato_Higashikata', 'Hato_Higashikata@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Hato Higashikata', 'Hato Higashikata (東方 鳩, Higashikata Hato) is a side character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion. Introduced early in the story, she gains significance in the "Hato Brought Her Boyfriend Home" story arc and becomes a temporary ally in Walking Heart.', TIMESTAMP WITH TIME ZONE '2020-05-29 11:11:24+00', 64.28::money, TRUE);
	VALUES (576, 'Daiya_Higashikata', 'Daiya_Higashikata@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Daiya Higashikata', '
Daiya Higashikata (東方 大弥, Higashikata Daiya) is a side character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion. Introduced as an antagonist in the "California King Bed" story arc, Daiya becomes a neutral character in subsequent arcs.', TIMESTAMP WITH TIME ZONE '2019-01-27 23:35:42+00', 197.83::money, FALSE);
	VALUES (577, 'Kaato_Higashikata', 'Kaato_Higashikata@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Kaato Higashikata', 'Kaato Higashikata (東方 花都, Higashikata Kāto) is a tertiary character featured in the eighth part of the JoJo''s Bizarre Adventure series, JoJolion.', TIMESTAMP WITH TIME ZONE '2019-03-12 20:15:03+00', 141.79::money, FALSE);
	VALUES (578, 'Kei_Nijimura', 'Kei_Nijimura@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Kei Nijimura', 'Kei Nijimura (虹村 京, Nijimura Kei) is a minor ally featured in the eighth part of the JoJo''s Bizarre Adventure series, JoJolion. Appearing as an antagonist in the "Paisley Park and Born This Way" story arc, she then becomes an ally in "The Wonder of You (The Miracle of Your Love)" story arc.', TIMESTAMP WITH TIME ZONE '2019-08-08 16:10:53+00', 94.22::money, TRUE);
	VALUES (579, 'Yoshikage_Kira_(JoJolion)', 'Yoshikage_Kira_(JoJolion)@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Yoshikage Kira (JoJolion)', 'Yoshikage Kira (吉良 吉影, Kira Yoshikage) is a character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion. Introduced early in the story, Yoshikage gains significance in the "Vitamin C and Killer Queen" story arc.', TIMESTAMP WITH TIME ZONE '2018-07-15 20:40:15+00', 163.49::money, TRUE);
	VALUES (580, 'Josefumi_Kujo', 'Josefumi_Kujo@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Josefumi Kujo', 'Josefumi Kujo (空条 仗世文, Kūjō Josefumi) is a character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion. Josefumi is alluded to in Love Love Deluxe, Part 2 but gains real significance in the "Vitamin C and Killer Queen" story arc.', TIMESTAMP WITH TIME ZONE '2020-08-27 01:03:58+00', 301.40::money, TRUE);
	VALUES (581, 'Karera_Sakunami', 'Karera_Sakunami@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Karera Sakunami', 'Karera Sakunami (作並 カレラ, Sakunami Karera) is a side character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion, specifically the "Love Love Deluxe" story arc.', TIMESTAMP WITH TIME ZONE '2018-05-24 19:21:08+00', 307.80::money, FALSE);
	VALUES (582, 'Holy_Joestar-Kira', 'Holy_Joestar-Kira@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Holy Joestar-Kira', 'Holy Joestar-Kira (吉良・ホリー・ジョースター, Kira Horī Jōsutā) is a side character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion. She is introduced in the ""Paisley Park" and "Born This Way"" story arc.', TIMESTAMP WITH TIME ZONE '2020-09-28 00:17:47+00', 0.00::money, FALSE);
	VALUES (583, 'Tamaki_Damo', 'Tamaki_Damo@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Tamaki Damo', 'Tamaki Damo (田最 環, Damo Tamaki) is a major antagonist featured in the 8th part of JoJo''s Bizarre Adventure, JoJolion, and introduced in the "Hato Brought Her Boyfriend Home" story arc.', TIMESTAMP WITH TIME ZONE '2018-12-19 23:28:57+00', 249.49::money, TRUE);
	VALUES (584, 'Yotsuyu_Yagiyama', 'Yotsuyu_Yagiyama@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Yotsuyu Yagiyama', 'Yotsuyu Yagiyama (八木山 夜露, Yagiyama Yotsuyu) is a minor antagonist featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion, introduced in the "Norisuke Higashikata, Tsurugi Higashikata, and Yotsuyu Yagiyama" story arc.', TIMESTAMP WITH TIME ZONE '2018-01-08 19:47:19+00', 5.65::money, TRUE);
