	VALUES (586, 'Dolomite', 'Dolomite@jojo.com', '$2b$12$N1UtObMPS8G.ell8TshuJuqOibopxbUxVh0pKyNiTcSFNUqgaw/76', 'Dolomite', '
Dolomite (ドロミテ, Doromite), also known as Masaji Dorokoma (泥駒 政次, Dorokoma Masaji), is a minor antagonist  featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion, specifically the "Dolomite''s Blue Lagoon" story arc.', TIMESTAMP WITH TIME ZONE '2019-02-23 16:50:46+00', 186.42::money, FALSE);
