	VALUES (46, 531, TIMESTAMP WITH TIME ZONE '2020-11-02 01:05:20+00', 'Se fazem conhecer perpetuamente
');

	VALUES (47, 52, TIMESTAMP WITH TIME ZONE '2019-06-22 13:05:48+00', 'Das cores a formosa diferença
');
	VALUES (47, 52, TIMESTAMP WITH TIME ZONE '2019-06-22 13:51:30+00', 'Os dous Cristãos, não vendo que enganados
');

	VALUES (48, 55, TIMESTAMP WITH TIME ZONE '2020-11-11 00:20:05+00', 'Vá a gente que mandar cortando os mares
');
	VALUES (48, 659, TIMESTAMP WITH TIME ZONE '2020-11-11 02:36:08+00', '"Mas a formosa armada, que viera
');
	VALUES (48, 659, TIMESTAMP WITH TIME ZONE '2020-11-11 03:58:30+00', 'Que Amor por grã mercê lhe terá dado.
');

	VALUES (49, 60, TIMESTAMP WITH TIME ZONE '2018-06-09 18:55:55+00', 'O véu, dos roxos lírios pouco avaro;
');

	VALUES (50, 60, TIMESTAMP WITH TIME ZONE '2018-08-18 21:35:12+00', 'Que entre Calecu jaz e Cananor,
');
	VALUES (50, 60, TIMESTAMP WITH TIME ZONE '2018-08-19 03:55:41+00', 'Galegos e Leoneses cavaleiros,
');
	VALUES (50, 564, TIMESTAMP WITH TIME ZONE '2018-08-19 09:17:28+00', 'Destruindo Panane com Coulete,
');

	VALUES (51, 62, TIMESTAMP WITH TIME ZONE '2020-06-17 10:55:29+00', 'Senão que tanto tempo ali tardassem,
');
	VALUES (51, 62, TIMESTAMP WITH TIME ZONE '2020-06-17 12:42:27+00', 'Mas queimar-lhe-á lugares, templos, casas;
');

	VALUES (52, 679, TIMESTAMP WITH TIME ZONE '2019-09-19 00:47:27+00', 'Quem poderá do mal aparelhado
');

	VALUES (53, 65, TIMESTAMP WITH TIME ZONE '2020-11-10 13:22:40+00', 'Tanto furor de ventos inimigos,
');

	VALUES (54, 66, TIMESTAMP WITH TIME ZONE '2019-10-04 03:42:49+00', 'Dos navegantes seus, como interesse
');

	VALUES (55, 371, TIMESTAMP WITH TIME ZONE '2019-06-23 04:18:38+00', 'De banhar os bigodes retorcidos.
');

	VALUES (56, 314, TIMESTAMP WITH TIME ZONE '2020-05-08 17:46:38+00', 'Uns Mafamede, e os outros Santiago.
');
	VALUES (56, 314, TIMESTAMP WITH TIME ZONE '2020-05-08 18:42:06+00', 'Este, onde tiver força o regimento
');
	VALUES (56, 314, TIMESTAMP WITH TIME ZONE '2020-05-08 19:54:37+00', 'Deseja de comprar-vos para genro.
');
	VALUES (56, 314, TIMESTAMP WITH TIME ZONE '2020-05-08 23:48:23+00', 'Ambos darão com braço forte, armado,
');

	VALUES (57, 67, TIMESTAMP WITH TIME ZONE '2018-12-22 12:14:46+00', 'Será ali arrebatado e ao Céu subido.
');
	VALUES (57, 67, TIMESTAMP WITH TIME ZONE '2018-12-22 13:03:01+00', 'Os ventos e despois os inimigos.
');
	VALUES (57, 508, TIMESTAMP WITH TIME ZONE '2018-12-22 18:27:26+00', 'E o bárbaro poder desbaratara
');
	VALUES (57, 67, TIMESTAMP WITH TIME ZONE '2018-12-22 21:13:34+00', '"Codro, porque o inimigo não vencesse,
');

	VALUES (58, 479, TIMESTAMP WITH TIME ZONE '2020-02-20 23:15:50+00', 'A terra Oriental, que o Idaspe lava;
');
	VALUES (58, 68, TIMESTAMP WITH TIME ZONE '2020-02-21 03:42:34+00', 'Malhas finas, e lâminas seguras,
');
	VALUES (58, 68, TIMESTAMP WITH TIME ZONE '2020-02-21 03:53:30+00', 'E que os Gentios Reis que não dariam
');
	VALUES (58, 68, TIMESTAMP WITH TIME ZONE '2020-02-21 08:16:00+00', 'Por estas longas águas se estenderam;
');

	VALUES (59, 316, TIMESTAMP WITH TIME ZONE '2021-03-31 19:20:15+00', 'Sujeita a feminino senhorio
');
	VALUES (59, 316, TIMESTAMP WITH TIME ZONE '2021-03-31 20:22:19+00', 'Trazem ferocidade, e furor tanto,
');
	VALUES (59, 316, TIMESTAMP WITH TIME ZONE '2021-04-01 03:40:47+00', 'Pera onde faça um sumptuoso templo
');
	VALUES (59, 69, TIMESTAMP WITH TIME ZONE '2021-04-01 04:09:19+00', 'Vence toda grandíloqua escritura."
');

	VALUES (60, 69, TIMESTAMP WITH TIME ZONE '2020-04-27 22:07:25+00', 'Te contei tudo quanto me pediste.
');
	VALUES (60, 69, TIMESTAMP WITH TIME ZONE '2020-04-28 00:41:11+00', 'Com o Capitão, e não com o Mauro engano.
');
	VALUES (60, 385, TIMESTAMP WITH TIME ZONE '2020-04-28 06:05:25+00', 'Este, pelo seu povo injuriado,
');

	VALUES (61, 72, TIMESTAMP WITH TIME ZONE '2020-05-08 18:49:22+00', 'Com os Portugueses já contra Castela,
');

	VALUES (62, 332, TIMESTAMP WITH TIME ZONE '2020-05-26 20:24:07+00', 'Morrer, enquanto fortes sostiveram
');
	VALUES (62, 72, TIMESTAMP WITH TIME ZONE '2020-05-26 23:06:25+00', 'Conciliam da terra os principais,
');

	VALUES (63, 73, TIMESTAMP WITH TIME ZONE '2021-02-19 04:09:01+00', 'O piloto fugir-lhe com presteza,
');
	VALUES (63, 73, TIMESTAMP WITH TIME ZONE '2021-02-19 11:52:23+00', 'O que às mãos cobiçosas vão negando.
');
	VALUES (63, 73, TIMESTAMP WITH TIME ZONE '2021-02-19 18:45:58+00', 'No mais interno fundo das profundas
');
	VALUES (63, 73, TIMESTAMP WITH TIME ZONE '2021-02-19 23:42:18+00', 'A Rei não obedece, nem consente,
');

	VALUES (64, 265, TIMESTAMP WITH TIME ZONE '2020-09-30 23:21:53+00', 'Morrem, arrenegando o Céu e os fados.
');
	VALUES (64, 73, TIMESTAMP WITH TIME ZONE '2020-10-01 01:11:14+00', 'Que por se sustentar em toda idade,
');

	VALUES (65, 74, TIMESTAMP WITH TIME ZONE '2019-10-11 07:02:36+00', 'Confessar-me a verdade limpa e nua,
');

	VALUES (66, 76, TIMESTAMP WITH TIME ZONE '2020-05-21 12:49:23+00', 'Bramindo o negro mar, de longe brada
');
	VALUES (66, 134, TIMESTAMP WITH TIME ZONE '2020-05-21 16:27:00+00', 'Elas começam súbito a gritar,
');
	VALUES (66, 134, TIMESTAMP WITH TIME ZONE '2020-05-21 20:06:31+00', 'O Português despacho dilatavam.
');
	VALUES (66, 134, TIMESTAMP WITH TIME ZONE '2020-05-22 01:38:15+00', '"Chegado tinha o prazo prometido,
');

	VALUES (67, 76, TIMESTAMP WITH TIME ZONE '2019-06-30 18:20:14+00', 'Das águas o poder lhe obedecia.
');

	VALUES (68, 77, TIMESTAMP WITH TIME ZONE '2021-04-20 01:01:51+00', 'Que a Jesu Cristo teve a mão no lado.
');

	VALUES (69, 79, TIMESTAMP WITH TIME ZONE '2021-01-21 18:26:46+00', 'E também as memórias gloriosas
');
	VALUES (69, 93, TIMESTAMP WITH TIME ZONE '2021-01-22 02:01:30+00', 'Os dous Cristãos, não vendo que enganados
');
	VALUES (69, 93, TIMESTAMP WITH TIME ZONE '2021-01-22 03:20:30+00', 'Na forma doutro Mouro, que tomara.
');

	VALUES (70, 79, TIMESTAMP WITH TIME ZONE '2021-01-25 00:49:43+00', 'Levemente o perdoa, e foi servido
');

	VALUES (71, 80, TIMESTAMP WITH TIME ZONE '2019-04-10 12:03:59+00', 'Comércio consentir das abastanças
');

	VALUES (72, 80, TIMESTAMP WITH TIME ZONE '2020-11-09 05:07:53+00', 'Peito revolverei da Maura gente;
');
	VALUES (72, 297, TIMESTAMP WITH TIME ZONE '2020-11-09 10:06:16+00', 'Como no galardão injusto e duro;
');
	VALUES (72, 80, TIMESTAMP WITH TIME ZONE '2020-11-09 15:51:33+00', 'Que com tão forte peito navegais.
');

	VALUES (73, 401, TIMESTAMP WITH TIME ZONE '2020-09-14 21:37:39+00', 'Dos altos feitos grandes e subidos.
');

	VALUES (74, 83, TIMESTAMP WITH TIME ZONE '2019-12-10 09:31:07+00', 'Dou-vos também aquele ilustre Gama,
');
	VALUES (74, 83, TIMESTAMP WITH TIME ZONE '2019-12-10 14:00:15+00', 'Em pedra não, mas em desejo aceso?
');

	VALUES (75, 544, TIMESTAMP WITH TIME ZONE '2019-06-16 19:38:34+00', 'Faria tremular e pôr espanto
');
	VALUES (75, 84, TIMESTAMP WITH TIME ZONE '2019-06-17 02:05:31+00', 'Vestido assim e calçado (que, coa mora
');
	VALUES (75, 84, TIMESTAMP WITH TIME ZONE '2019-06-17 03:58:45+00', 'Ceres, Palas e Juno, com Diana,
');

	VALUES (76, 86, TIMESTAMP WITH TIME ZONE '2021-03-25 20:00:58+00', 'Se estende uma fralda estreita, que combate
');
	VALUES (76, 86, TIMESTAMP WITH TIME ZONE '2021-03-26 03:44:45+00', 'E com pano delgado, que se tece
');

	VALUES (77, 533, TIMESTAMP WITH TIME ZONE '2019-04-30 19:14:21+00', 'E da barra inimiga a desviavam.
');
	VALUES (77, 86, TIMESTAMP WITH TIME ZONE '2019-05-01 02:03:43+00', '"Nestas e outras palavras que diziam
');
	VALUES (77, 86, TIMESTAMP WITH TIME ZONE '2019-05-01 04:17:30+00', 'E de Jáquete a íntima enseada;
');
	VALUES (77, 86, TIMESTAMP WITH TIME ZONE '2019-05-01 11:36:09+00', 'Toma a ilha ilustríssima de Goa!
');

	VALUES (78, 366, TIMESTAMP WITH TIME ZONE '2020-05-18 16:42:04+00', 'Do outro Pedro cruíssimo os alcança,
');

	VALUES (79, 292, TIMESTAMP WITH TIME ZONE '2020-06-15 21:08:25+00', 'Que em risinhos alegres se tornava!
');

	VALUES (80, 541, TIMESTAMP WITH TIME ZONE '2019-06-16 21:25:19+00', 'E do Orionte o gesto turbulento;
');
	VALUES (80, 88, TIMESTAMP WITH TIME ZONE '2019-06-17 04:33:44+00', 'E pela costa abaixo o mar abrirmos
');

	VALUES (81, 657, TIMESTAMP WITH TIME ZONE '2020-08-02 07:57:19+00', 'E tornando a contar-te das profundas
');
	VALUES (81, 90, TIMESTAMP WITH TIME ZONE '2020-08-02 08:40:31+00', 'Que a socorrê-la vinha diligente
');
	VALUES (81, 657, TIMESTAMP WITH TIME ZONE '2020-08-02 14:52:37+00', 'A buscar o repouso que descansa
');

	VALUES (82, 90, TIMESTAMP WITH TIME ZONE '2020-10-02 09:10:57+00', 'Mas os Mouros que andavam pela praia,
');
	VALUES (82, 90, TIMESTAMP WITH TIME ZONE '2020-10-02 11:59:04+00', 'Rompe, corta, desfaz, abola e talha.
');

	VALUES (83, 223, TIMESTAMP WITH TIME ZONE '2020-05-25 16:46:37+00', 'Que recebem de Febe crescimento,
');

	VALUES (84, 377, TIMESTAMP WITH TIME ZONE '2020-10-18 11:06:29+00', 'E entrega Capitães aos inimigos;
');
	VALUES (84, 377, TIMESTAMP WITH TIME ZONE '2020-10-18 17:56:31+00', 'Nenhum sinal aqui da Índia achamos
');
	VALUES (84, 377, TIMESTAMP WITH TIME ZONE '2020-10-19 01:31:30+00', 'O que o sublime Gama contaria,
');

	VALUES (85, 93, TIMESTAMP WITH TIME ZONE '2021-01-04 00:32:07+00', 'O céu, a terra e as ondas atroando.
');

	VALUES (86, 93, TIMESTAMP WITH TIME ZONE '2019-05-24 19:31:35+00', 'A frota principal do Samorim,
');
	VALUES (86, 691, TIMESTAMP WITH TIME ZONE '2019-05-25 00:27:51+00', 'Na pátria, onde profeta ninguém é,
');
	VALUES (86, 93, TIMESTAMP WITH TIME ZONE '2019-05-25 00:45:16+00', 'Pois se com seus descuidos, ou pecados,
');

	VALUES (87, 94, TIMESTAMP WITH TIME ZONE '2020-09-07 01:37:34+00', 'A qual virá depois a ser senhora
');
	VALUES (87, 561, TIMESTAMP WITH TIME ZONE '2020-09-07 03:42:24+00', 'Vencidos vêm do sono, e mal despertos;
');
	VALUES (87, 561, TIMESTAMP WITH TIME ZONE '2020-09-07 08:58:27+00', 'O bem co''o mal, o gosto coa tristeza.
');
	VALUES (87, 94, TIMESTAMP WITH TIME ZONE '2020-09-07 11:11:38+00', 'Uns trazem derredor de si cingidos,
');

	VALUES (88, 517, TIMESTAMP WITH TIME ZONE '2019-12-31 19:23:03+00', 'Pera o felice Gama assi dizia:
');

	VALUES (89, 95, TIMESTAMP WITH TIME ZONE '2020-01-14 00:51:39+00', 'Se dava às flores cor a bela Aurora,
');
	VALUES (89, 95, TIMESTAMP WITH TIME ZONE '2020-01-14 02:58:54+00', 'Com a presença e leda humanidade;
');
	VALUES (89, 95, TIMESTAMP WITH TIME ZONE '2020-01-14 05:40:36+00', 'Um Brâmene, pessoa proeminente,
');
	VALUES (89, 455, TIMESTAMP WITH TIME ZONE '2020-01-14 12:57:58+00', 'Um corta o mar a nado diligente,
');

	VALUES (90, 630, TIMESTAMP WITH TIME ZONE '2019-11-29 04:24:50+00', 'O Rei, que já sabia da nobreza
');
	VALUES (90, 630, TIMESTAMP WITH TIME ZONE '2019-11-29 06:24:04+00', 'Conciliam da terra os principais,
');

	VALUES (91, 99, TIMESTAMP WITH TIME ZONE '2020-07-23 14:16:44+00', 'Vencedor forte e intrépido, ao possante
');
	VALUES (91, 99, TIMESTAMP WITH TIME ZONE '2020-07-23 17:43:05+00', 'O Mestre morre ali de Santiago,
');
	VALUES (91, 459, TIMESTAMP WITH TIME ZONE '2020-07-23 18:23:47+00', 'Daqueles Reis, que foram dilatando
');

	VALUES (92, 100, TIMESTAMP WITH TIME ZONE '2019-01-29 17:04:13+00', 'Os ventos brandamente respiravam,
');

	VALUES (93, 100, TIMESTAMP WITH TIME ZONE '2019-06-25 22:48:26+00', 'Mostrando-se Cristão, e fabricava
');

	VALUES (94, 101, TIMESTAMP WITH TIME ZONE '2020-11-25 04:12:57+00', 'Segundo a qualidade for das chagas;
');
	VALUES (94, 101, TIMESTAMP WITH TIME ZONE '2020-11-25 10:31:47+00', 'Vencidos e em miséria extrema postos;
');
	VALUES (94, 101, TIMESTAMP WITH TIME ZONE '2020-11-25 11:53:01+00', 'Muda quaisquer propósitos tomados,
');

	VALUES (95, 517, TIMESTAMP WITH TIME ZONE '2020-04-22 03:35:23+00', 'Breve repouso então aos olhos dava,
');
	VALUES (95, 102, TIMESTAMP WITH TIME ZONE '2020-04-22 09:30:55+00', 'Que Tethys indignada lhe bradou:
');
	VALUES (95, 102, TIMESTAMP WITH TIME ZONE '2020-04-22 15:14:00+00', 'E que pode ser delas oprimido,
');

	VALUES (96, 412, TIMESTAMP WITH TIME ZONE '2019-01-01 02:02:32+00', '"Mais ia por diante o monstro horrendo
');
	VALUES (96, 103, TIMESTAMP WITH TIME ZONE '2019-01-01 05:05:33+00', 'Tão longe da tua pátria Lusitana?"
');

	VALUES (97, 103, TIMESTAMP WITH TIME ZONE '2019-11-10 12:30:51+00', 'E el-Rei se vai do mar aos nobres paços.
');
	VALUES (97, 338, TIMESTAMP WITH TIME ZONE '2019-11-10 12:47:16+00', 'De mais conversação, por si mostravam
');
	VALUES (97, 103, TIMESTAMP WITH TIME ZONE '2019-11-10 13:01:45+00', 'Onde uma mesa fazem, que se estende
');
	VALUES (97, 103, TIMESTAMP WITH TIME ZONE '2019-11-10 14:31:17+00', 'E guarde-se não seja ainda comido
');

	VALUES (98, 394, TIMESTAMP WITH TIME ZONE '2020-08-29 22:51:16+00', 'Nas quais hão-de viver muitas idades.
');
	VALUES (98, 104, TIMESTAMP WITH TIME ZONE '2020-08-30 03:32:38+00', 'Contra o mundo rebelde, por que emende
');
	VALUES (98, 394, TIMESTAMP WITH TIME ZONE '2020-08-30 11:04:33+00', 'Se lança, e teve um fero desafio
');

	VALUES (99, 104, TIMESTAMP WITH TIME ZONE '2020-01-14 10:10:59+00', 'Varias províncias tem de várias gentes,
');
	VALUES (99, 133, TIMESTAMP WITH TIME ZONE '2020-01-14 17:32:57+00', 'Os que desbaratava este excelente,
');

	VALUES (100, 105, TIMESTAMP WITH TIME ZONE '2019-06-09 13:27:22+00', 'De ver eousas estranhas desejosa
');

	VALUES (101, 428, TIMESTAMP WITH TIME ZONE '2019-03-27 05:30:37+00', 'Sem vós, Ninfas do Tejo e do Mondego,
');
	VALUES (101, 107, TIMESTAMP WITH TIME ZONE '2019-03-27 05:38:54+00', 'A densa que nos céus a governava,
');
	VALUES (101, 428, TIMESTAMP WITH TIME ZONE '2019-03-27 06:53:38+00', 'Porque nem tu tens Rei, nem pátria amada,
');
	VALUES (101, 428, TIMESTAMP WITH TIME ZONE '2019-03-27 14:02:35+00', 'Co rumor famosíssimo, e perclaro.
');

	VALUES (102, 107, TIMESTAMP WITH TIME ZONE '2018-05-19 10:53:39+00', 'Que cuidar de fazer aos vossos guerra.
');

	VALUES (103, 108, TIMESTAMP WITH TIME ZONE '2020-07-15 08:16:20+00', 'Quanto a desesperar já compelidos,
');

	VALUES (104, 191, TIMESTAMP WITH TIME ZONE '2018-12-25 21:52:40+00', 'Quereis levar a palma vencedora,
');

	VALUES (105, 485, TIMESTAMP WITH TIME ZONE '2019-03-19 21:26:40+00', 'A Bóreas, que do peito mais queria,
');
	VALUES (105, 485, TIMESTAMP WITH TIME ZONE '2019-03-20 03:36:58+00', 'Calecu tem a ilustre dignidade
');
	VALUES (105, 112, TIMESTAMP WITH TIME ZONE '2019-03-20 10:54:19+00', 'Onde os campos de Dite a Estige lava;
');

	VALUES (106, 114, TIMESTAMP WITH TIME ZONE '2020-07-30 14:20:37+00', 'Estão em várias obras trabalhando:
');
	VALUES (106, 534, TIMESTAMP WITH TIME ZONE '2020-07-30 15:37:45+00', 'Por contraste de vento àquela parte,
');

	VALUES (107, 505, TIMESTAMP WITH TIME ZONE '2019-09-01 17:48:37+00', 'Que em multidão com elas se igualavam.
');
	VALUES (107, 505, TIMESTAMP WITH TIME ZONE '2019-09-02 01:43:02+00', 'Ao longo desta costa, que tereis,
');
	VALUES (107, 505, TIMESTAMP WITH TIME ZONE '2019-09-02 08:43:55+00', 'Não eram senão prémios que reparte
');
	VALUES (107, 505, TIMESTAMP WITH TIME ZONE '2019-09-02 16:29:58+00', 'Já no largo Oceano navegavam,
');

	VALUES (108, 371, TIMESTAMP WITH TIME ZONE '2019-06-13 12:57:05+00', 'Que o coração no peito lhe não cabe,
');

	VALUES (109, 365, TIMESTAMP WITH TIME ZONE '2020-10-27 22:56:31+00', 'Na qual tu mereceste paz serena!
');
	VALUES (109, 365, TIMESTAMP WITH TIME ZONE '2020-10-28 00:28:33+00', 'Com Ásia se avizinha; mas o rio
');
	VALUES (109, 115, TIMESTAMP WITH TIME ZONE '2020-10-28 03:49:39+00', 'É Dom Paio Correia, cuja manha
');

	VALUES (110, 116, TIMESTAMP WITH TIME ZONE '2020-11-05 22:45:35+00', 'Mas, neste passo, assim prontos estando
');
	VALUES (110, 209, TIMESTAMP WITH TIME ZONE '2020-11-06 06:19:47+00', 'Será o injusto mando executado
');
	VALUES (110, 209, TIMESTAMP WITH TIME ZONE '2020-11-06 07:30:23+00', 'Sigue-me firme e forte, com prudência,
');
	VALUES (110, 116, TIMESTAMP WITH TIME ZONE '2020-11-06 09:39:30+00', 'Um por seu capitão, que peregrino
');

	VALUES (111, 117, TIMESTAMP WITH TIME ZONE '2019-12-23 17:50:13+00', 'As inquietas ondas apartando;
');
	VALUES (111, 117, TIMESTAMP WITH TIME ZONE '2019-12-23 21:30:20+00', 'Este, porque se Espanha não temesse,
');
	VALUES (111, 117, TIMESTAMP WITH TIME ZONE '2019-12-23 23:05:00+00', 'Que sempre aos nautas ante os olhos anda.
');

	VALUES (112, 341, TIMESTAMP WITH TIME ZONE '2019-12-25 02:06:21+00', 'Mostrara, enquanto o mar cortava a armada,
');
	VALUES (112, 117, TIMESTAMP WITH TIME ZONE '2019-12-25 06:42:17+00', '"Estas obras de Baco são, por certo,
');

	VALUES (113, 118, TIMESTAMP WITH TIME ZONE '2021-01-14 15:04:10+00', 'Por que cresçam as rendas e abastanças,
');
	VALUES (113, 692, TIMESTAMP WITH TIME ZONE '2021-01-14 20:44:42+00', 'Os muros de Marrocos e Trudante,
');

	VALUES (114, 398, TIMESTAMP WITH TIME ZONE '2020-11-05 10:47:40+00', 'Depois que uma moça vil na Apúlia viste.
');
	VALUES (114, 398, TIMESTAMP WITH TIME ZONE '2020-11-05 12:12:58+00', 'Mova-te a piedade sua e minha,
');
	VALUES (114, 119, TIMESTAMP WITH TIME ZONE '2020-11-05 13:34:02+00', 'Tratar branduras em tanta aspereza;
');

	VALUES (115, 292, TIMESTAMP WITH TIME ZONE '2020-10-29 06:00:29+00', 'Que, para se evitar força tamanha,
');

	VALUES (116, 320, TIMESTAMP WITH TIME ZONE '2020-01-13 01:39:11+00', 'Estas, que agora olhais, abaterão;
');
	VALUES (116, 320, TIMESTAMP WITH TIME ZONE '2020-01-13 09:07:26+00', '"Do justo e duro Pedro nasce o brando,
');
	VALUES (116, 122, TIMESTAMP WITH TIME ZONE '2020-01-13 16:49:54+00', '(Quem viu honra tão longe da verdade?)
');
	VALUES (116, 320, TIMESTAMP WITH TIME ZONE '2020-01-13 22:57:18+00', 'Por terem o remédio verdadeiro
');

	VALUES (117, 123, TIMESTAMP WITH TIME ZONE '2020-10-16 03:22:36+00', 'Fonte de desamparos e adultérios,
');
	VALUES (117, 123, TIMESTAMP WITH TIME ZONE '2020-10-16 04:06:10+00', 'Vós, que à custa de vossas várias mortes
');
	VALUES (117, 123, TIMESTAMP WITH TIME ZONE '2020-10-16 08:00:42+00', 'Rompe toda a tardança, acude cedo
');
	VALUES (117, 468, TIMESTAMP WITH TIME ZONE '2020-10-16 11:17:08+00', 'Daquele a quem o mar caiu em sorte.
');

	VALUES (118, 124, TIMESTAMP WITH TIME ZONE '2021-05-09 09:36:00+00', 'Senão no sumo Deus, que o Céu regia,
');
	VALUES (118, 362, TIMESTAMP WITH TIME ZONE '2021-05-09 14:14:29+00', 'Tomais mil vezes, e no torpe e escuro
');
	VALUES (118, 124, TIMESTAMP WITH TIME ZONE '2021-05-09 18:04:58+00', 'A pequena grandura dum batel
');
	VALUES (118, 362, TIMESTAMP WITH TIME ZONE '2021-05-09 21:39:23+00', '"Codro, porque o inimigo não vencesse,
');

	VALUES (119, 124, TIMESTAMP WITH TIME ZONE '2021-05-10 07:44:42+00', 'De panos de algodão vinham vestidos,
');

