	VALUES (190, 692, TIMESTAMP WITH TIME ZONE '2021-01-22 17:58:40+00', 'D''além do claro Tejo deleitoso;
');

	VALUES (191, 191, TIMESTAMP WITH TIME ZONE '2020-09-07 11:31:12+00', 'Mas inda o mar instábil exprimentam,
');
	VALUES (191, 187, TIMESTAMP WITH TIME ZONE '2020-09-07 14:03:18+00', 'Descobridor das terras do Oriente.
');
	VALUES (191, 191, TIMESTAMP WITH TIME ZONE '2020-09-07 21:52:25+00', 'Destruídos depois da Grega insânia.
');

	VALUES (192, 298, TIMESTAMP WITH TIME ZONE '2020-08-22 05:00:21+00', 'A terra nunca de outrem sojugada.
');
	VALUES (192, 298, TIMESTAMP WITH TIME ZONE '2020-08-22 10:18:51+00', 'A pôr a vida e reino totalmente
');
	VALUES (192, 187, TIMESTAMP WITH TIME ZONE '2020-08-22 17:01:46+00', 'Tem as relíquias santas e benditas
');

	VALUES (193, 369, TIMESTAMP WITH TIME ZONE '2020-05-13 01:25:47+00', 'Vêm do naufrágio triste e miserando,
');
	VALUES (193, 369, TIMESTAMP WITH TIME ZONE '2020-05-13 07:45:43+00', 'Ajunta-se a inimiga multidão
