	VALUES (193, 369, TIMESTAMP WITH TIME ZONE '2020-05-13 08:53:05+00', 'Pola pedra onde está a pegada humana.
');
	VALUES (193, 188, TIMESTAMP WITH TIME ZONE '2020-05-13 10:16:10+00', 'Algum deixa no mundo estar vazio.
');

	VALUES (194, 347, TIMESTAMP WITH TIME ZONE '2021-02-26 15:53:25+00', 'Quase piramidal, que no regaço
');
	VALUES (194, 347, TIMESTAMP WITH TIME ZONE '2021-02-26 21:18:53+00', 'Já para se entregar quase movidos
');
	VALUES (194, 347, TIMESTAMP WITH TIME ZONE '2021-02-27 03:59:17+00', 'Tu, que por guerras cruas, tais e tantas,
');
	VALUES (194, 188, TIMESTAMP WITH TIME ZONE '2021-02-27 05:33:33+00', 'Que de quebrar-lhe a nau lhe mete medo.
');

	VALUES (195, 327, TIMESTAMP WITH TIME ZONE '2019-10-01 12:09:28+00', '"Põe-me onde se use toda a feridade,
');
	VALUES (195, 189, TIMESTAMP WITH TIME ZONE '2019-10-01 17:33:57+00', 'Não pode ter subido pensamento.
');
	VALUES (195, 189, TIMESTAMP WITH TIME ZONE '2019-10-01 17:52:47+00', 'Os brutos animais de toda sorte.
');
	VALUES (195, 189, TIMESTAMP WITH TIME ZONE '2019-10-01 18:09:32+00', '"Mas, despois que as Estrelas o chamarem,
');

	VALUES (196, 189, TIMESTAMP WITH TIME ZONE '2020-08-29 11:44:44+00', 'Estão a seu conselho oferecidas.
');
	VALUES (196, 189, TIMESTAMP WITH TIME ZONE '2020-08-29 15:04:53+00', '"Entre as damas gentis da corte Inglesa
');
	VALUES (196, 296, TIMESTAMP WITH TIME ZONE '2020-08-29 17:20:23+00', 'A vitória trazia, e presa rica,
');

	VALUES (197, 446, TIMESTAMP WITH TIME ZONE '2020-03-23 20:11:05+00', 'Sabendo como o filho está cercado
');
	VALUES (197, 192, TIMESTAMP WITH TIME ZONE '2020-03-24 03:48:14+00', 'Varias províncias tem de várias gentes,
');

	VALUES (198, 488, TIMESTAMP WITH TIME ZONE '2021-04-08 10:27:30+00', 'Desta arte o Malabar, destarte o Luso
');
	VALUES (198, 193, TIMESTAMP WITH TIME ZONE '2021-04-08 13:56:46+00', 'No Reino de cristal líquido e manso;
');

	VALUES (199, 510, TIMESTAMP WITH TIME ZONE '2021-05-07 23:18:39+00', 'O mantimento o leve passarinho.
');
	VALUES (199, 510, TIMESTAMP WITH TIME ZONE '2021-05-08 04:31:50+00', '"Sublime Rei, a quem do Olimpo puro
');
	VALUES (199, 193, TIMESTAMP WITH TIME ZONE '2021-05-08 07:23:25+00', 'Que triunfos, que palmas, que vitórias?
');
	VALUES (199, 193, TIMESTAMP WITH TIME ZONE '2021-05-08 09:03:42+00', 'De poder ver o povo batizado,
');

	VALUES (200, 616, TIMESTAMP WITH TIME ZONE '2021-03-26 15:46:18+00', 'Que entre as correntes Indicas se encerra,
');
	VALUES (200, 194, TIMESTAMP WITH TIME ZONE '2021-03-26 21:43:25+00', 'Como por regimento enfim levava,
');

	VALUES (201, 691, TIMESTAMP WITH TIME ZONE '2019-09-30 22:28:51+00', '"Eis aqui, quase cume da cabeça
');

	VALUES (202, 195, TIMESTAMP WITH TIME ZONE '2019-10-14 01:00:54+00', 'As venturosas naus, levando a proa
');
	VALUES (202, 424, TIMESTAMP WITH TIME ZONE '2019-10-14 05:45:54+00', 'O prazer de chegar à pátria cara,
');
	VALUES (202, 195, TIMESTAMP WITH TIME ZONE '2019-10-14 06:37:39+00', 'Os Naires sós são dados ao perigo
');

	VALUES (203, 635, TIMESTAMP WITH TIME ZONE '2021-01-07 22:25:06+00', 'Outro de arco encurvado e seta ervada,
');

	VALUES (204, 490, TIMESTAMP WITH TIME ZONE '2020-11-12 17:18:12+00', 'O pastor de Massília lhos furtara;
');
	VALUES (204, 490, TIMESTAMP WITH TIME ZONE '2020-11-12 19:10:12+00', 'Que não só se defendem, mas ofendem:
');
	VALUES (204, 196, TIMESTAMP WITH TIME ZONE '2020-11-13 01:01:22+00', 'Da tinta, que dá o múrice excelente,
');
	VALUES (204, 490, TIMESTAMP WITH TIME ZONE '2020-11-13 02:22:18+00', 'Para que de vagar se troque e venda:
');

	VALUES (205, 197, TIMESTAMP WITH TIME ZONE '2020-06-02 07:33:57+00', 'Quem já vem pelo Duque nomeado.
');
	VALUES (205, 197, TIMESTAMP WITH TIME ZONE '2020-06-02 14:06:37+00', 'Começam de enxergar subitamente
');
	VALUES (205, 480, TIMESTAMP WITH TIME ZONE '2020-06-02 21:05:09+00', '"Disse então a Veloso um companheiro
');
	VALUES (205, 480, TIMESTAMP WITH TIME ZONE '2020-06-03 01:20:22+00', 'Antes que soe o estouro, mal sofrido
');

	VALUES (206, 620, TIMESTAMP WITH TIME ZONE '2020-10-03 22:18:18+00', 'Em brincos amorosos mal tratada,
');
	VALUES (206, 620, TIMESTAMP WITH TIME ZONE '2020-10-03 22:22:17+00', 'De disforme e grandíssima estatura,
');
	VALUES (206, 197, TIMESTAMP WITH TIME ZONE '2020-10-03 22:36:05+00', 'Ali a formosa Deusa lhe aconselha
');

	VALUES (207, 198, TIMESTAMP WITH TIME ZONE '2019-01-21 21:11:45+00', 'Pluma na gorra, um pouco declinada.
');
	VALUES (207, 519, TIMESTAMP WITH TIME ZONE '2019-01-21 21:39:50+00', 'Interesse maior do que lhe vinha,
');
	VALUES (207, 198, TIMESTAMP WITH TIME ZONE '2019-01-21 23:39:51+00', 'A vontade senti de tal maneira
');
	VALUES (207, 198, TIMESTAMP WITH TIME ZONE '2019-01-22 00:44:57+00', 'Que vibra os feros raios de Vulcano,
');

	VALUES (208, 513, TIMESTAMP WITH TIME ZONE '2019-12-30 12:41:16+00', 'Mas o de Luso arnês, couraça e malha
');

	VALUES (209, 199, TIMESTAMP WITH TIME ZONE '2020-08-14 03:56:44+00', 'Que entre um e outro manjar se ale vantavam,
');
	VALUES (209, 522, TIMESTAMP WITH TIME ZONE '2020-08-14 04:36:34+00', '"Dom Nuno Alvares digo, verdadeiro
');
	VALUES (209, 199, TIMESTAMP WITH TIME ZONE '2020-08-14 07:40:52+00', 'Como se fora pérfida inimiga.
');
	VALUES (209, 522, TIMESTAMP WITH TIME ZONE '2020-08-14 12:50:02+00', 'Que a morte, se pudesse, neste dia,
');

	VALUES (210, 202, TIMESTAMP WITH TIME ZONE '2018-12-29 22:03:51+00', 'Um venerando e próspero senhor;
');
	VALUES (210, 395, TIMESTAMP WITH TIME ZONE '2018-12-29 23:19:32+00', 'Levemente o perdoa, e foi servido
');
	VALUES (210, 202, TIMESTAMP WITH TIME ZONE '2018-12-30 01:15:44+00', 'Que, para quanto tem determinado,
');

	VALUES (211, 202, TIMESTAMP WITH TIME ZONE '2019-07-05 10:30:01+00', 'Verás as várias partes, que os insanos
');
	VALUES (211, 202, TIMESTAMP WITH TIME ZONE '2019-07-05 17:06:43+00', 'Batéis à vela entravam e saíam.
');
	VALUES (211, 544, TIMESTAMP WITH TIME ZONE '2019-07-05 21:19:37+00', 'Maior crédito, e fé de mais alteza,
');
	VALUES (211, 544, TIMESTAMP WITH TIME ZONE '2019-07-05 21:30:13+00', 'O céu fere com gritos nisto a gente,
');

	VALUES (212, 203, TIMESTAMP WITH TIME ZONE '2021-02-10 22:30:42+00', '--"Eu sou aquele oculto e grande Cabo,
');

	VALUES (213, 514, TIMESTAMP WITH TIME ZONE '2020-07-23 13:06:35+00', 'Nesta costa africana, como amigos.
');
	VALUES (213, 514, TIMESTAMP WITH TIME ZONE '2020-07-23 17:08:28+00', '"Porém depois que a escura noite eterna
');
	VALUES (213, 204, TIMESTAMP WITH TIME ZONE '2020-07-23 21:46:13+00', 'Estelífero pólo, e claro assento,
');

	VALUES (214, 463, TIMESTAMP WITH TIME ZONE '2020-07-15 03:25:04+00', 'Dizia o Catual ao Capitão:
');

	VALUES (215, 367, TIMESTAMP WITH TIME ZONE '2019-09-28 15:50:39+00', 'Do Indo, pelas ondas do Oceano,
');
	VALUES (215, 208, TIMESTAMP WITH TIME ZONE '2019-09-28 20:35:15+00', 'O do Rei que é tão longe obedecido.
');
	VALUES (215, 367, TIMESTAMP WITH TIME ZONE '2019-09-29 00:20:34+00', 'Este, pelo seu povo injuriado,
');

	VALUES (216, 511, TIMESTAMP WITH TIME ZONE '2019-03-07 06:03:32+00', 'Que, sem sabê-las, sei que são de preço.
');
	VALUES (216, 209, TIMESTAMP WITH TIME ZONE '2019-03-07 08:51:48+00', 'Perdendo o esforço veio, e bélica arte;
');
	VALUES (216, 511, TIMESTAMP WITH TIME ZONE '2019-03-07 13:09:44+00', 'Do fim de seu desejo se perdia;
');

	VALUES (217, 210, TIMESTAMP WITH TIME ZONE '2020-11-24 22:14:31+00', 'Para ir nelas a ser religioso,
');
	VALUES (217, 210, TIMESTAMP WITH TIME ZONE '2020-11-25 00:27:12+00', 'Não se lhe pode muito sustentar
');
	VALUES (217, 210, TIMESTAMP WITH TIME ZONE '2020-11-25 01:04:55+00', 'Destro na lança mais que no cajado;
');

	VALUES (218, 210, TIMESTAMP WITH TIME ZONE '2020-12-03 01:37:38+00', 'Que cá por estas partes se derrama:
');

	VALUES (219, 547, TIMESTAMP WITH TIME ZONE '2020-09-28 23:51:02+00', 'Dar-lhe nos mares tristes alegria.
');

	VALUES (220, 213, TIMESTAMP WITH TIME ZONE '2020-08-30 01:11:23+00', 'A seus pés derribadas, e estandartes!"
');
	VALUES (220, 213, TIMESTAMP WITH TIME ZONE '2020-08-30 03:22:44+00', 'Das Européias terras abundantes
');
	VALUES (220, 213, TIMESTAMP WITH TIME ZONE '2020-08-30 08:43:22+00', 'Quase movidos de alta piedade;
');

	VALUES (221, 216, TIMESTAMP WITH TIME ZONE '2020-09-28 04:35:33+00', 'De quem sem ti não pode ser guardado!
');
	VALUES (221, 354, TIMESTAMP WITH TIME ZONE '2020-09-28 09:31:56+00', '"Eis vem o pai, com ânimo estupendo,
');
	VALUES (221, 216, TIMESTAMP WITH TIME ZONE '2020-09-28 12:38:47+00', 'As portas douro fino, e marchetadas
');
	VALUES (221, 216, TIMESTAMP WITH TIME ZONE '2020-09-28 15:08:17+00', 'Para detrás a forte nau forçando;
');

	VALUES (222, 362, TIMESTAMP WITH TIME ZONE '2019-10-17 21:55:22+00', 'O Português, que tudo estima em nada,
');

	VALUES (223, 542, TIMESTAMP WITH TIME ZONE '2018-08-09 14:59:14+00', 'E que despacho já não esperava
');
	VALUES (223, 542, TIMESTAMP WITH TIME ZONE '2018-08-09 19:59:31+00', 'Muitos a vida, e em terra estranha e alheia
');

	VALUES (224, 237, TIMESTAMP WITH TIME ZONE '2019-10-19 20:06:54+00', 'Vide, com uns cachos roxos e outros verdes;
');
	VALUES (224, 220, TIMESTAMP WITH TIME ZONE '2019-10-20 03:35:41+00', 'Porque, saindo a gente descuidada,
');
	VALUES (224, 220, TIMESTAMP WITH TIME ZONE '2019-10-20 03:37:05+00', 'Nem triste hipocrisia val contra ela:
');
	VALUES (224, 220, TIMESTAMP WITH TIME ZONE '2019-10-20 04:31:11+00', 'E deixado em ajuda do gentio Rei de
');

	VALUES (225, 220, TIMESTAMP WITH TIME ZONE '2019-10-18 18:06:55+00', 'Ajudou já, nestoutra a ajude e siga.
');
	VALUES (225, 220, TIMESTAMP WITH TIME ZONE '2019-10-18 19:14:46+00', 'Das fomes, dos perigos grandes, quando
');
	VALUES (225, 361, TIMESTAMP WITH TIME ZONE '2019-10-18 22:51:23+00', 'Determinei por armas de tomá-la,
');
	VALUES (225, 220, TIMESTAMP WITH TIME ZONE '2019-10-19 05:57:11+00', 'Risos doces, sutis e argutos ditos,
');

	VALUES (226, 221, TIMESTAMP WITH TIME ZONE '2020-06-03 12:10:04+00', 'Tens por qual é, sincera e não dobrada,
');
	VALUES (226, 540, TIMESTAMP WITH TIME ZONE '2020-06-03 15:02:05+00', 'Agora às costas escapando a vida,
');

	VALUES (227, 265, TIMESTAMP WITH TIME ZONE '2020-12-14 05:18:29+00', 'Por muito mais culpado o julgaria.
');
	VALUES (227, 265, TIMESTAMP WITH TIME ZONE '2020-12-14 12:04:01+00', 'Mais do que fez a gente alta de Roma;
');
	VALUES (227, 265, TIMESTAMP WITH TIME ZONE '2020-12-14 18:32:31+00', 'Dinos todos de fama e maravilha,
');

	VALUES (228, 224, TIMESTAMP WITH TIME ZONE '2020-12-17 00:59:25+00', 'Que seja mor o dano que o perigo.
');
	VALUES (228, 551, TIMESTAMP WITH TIME ZONE '2020-12-17 01:01:22+00', 'Os Brâmenes o têm por cousa nova;
');

	VALUES (229, 357, TIMESTAMP WITH TIME ZONE '2018-11-23 20:08:27+00', 'Os livros, que tu pedes não trazia,
');
	VALUES (229, 357, TIMESTAMP WITH TIME ZONE '2018-11-24 03:41:34+00', 'Dando os corpos a fomes e vigias,
');
	VALUES (229, 357, TIMESTAMP WITH TIME ZONE '2018-11-24 07:59:28+00', 'A tomar vai Leiria, que tomada
');

	VALUES (230, 258, TIMESTAMP WITH TIME ZONE '2019-02-13 17:04:27+00', 'Que, do raio solar sendo ferido,
');
	VALUES (230, 225, TIMESTAMP WITH TIME ZONE '2019-02-13 20:17:07+00', 'Embarcação que o leve às naus lhe pede;
');
	VALUES (230, 258, TIMESTAMP WITH TIME ZONE '2019-02-14 01:42:56+00', 'Deixando a frota, em nenhum porto ou praia.
');
	VALUES (230, 258, TIMESTAMP WITH TIME ZONE '2019-02-14 05:41:18+00', 'Que a pátria, que de um fraco fio pende,
');

	VALUES (231, 253, TIMESTAMP WITH TIME ZONE '2021-04-02 20:27:58+00', 'Das serras de Narsinga, que alta prova
');
	VALUES (231, 226, TIMESTAMP WITH TIME ZONE '2021-04-02 21:38:39+00', 'Que, persuadindo a isso o povo rudo,
');

	VALUES (232, 228, TIMESTAMP WITH TIME ZONE '2020-11-16 11:05:08+00', 'Mil vezes cada hora me mentia.
');
	VALUES (232, 228, TIMESTAMP WITH TIME ZONE '2020-11-16 15:44:54+00', 'Fugindo as Ninfas vão por entre os ramos,
');
	VALUES (232, 228, TIMESTAMP WITH TIME ZONE '2020-11-16 19:55:05+00', 'Mas falta-lhe pincel, faltam-lhe cores,
');
	VALUES (232, 227, TIMESTAMP WITH TIME ZONE '2020-11-16 21:06:10+00', 'Daquela obrigação, que lhe ficara
');

	VALUES (233, 227, TIMESTAMP WITH TIME ZONE '2021-04-17 01:41:57+00', 'Bradando-vos estão que o povo bruto
');
	VALUES (233, 616, TIMESTAMP WITH TIME ZONE '2021-04-17 04:20:41+00', 'Ali se hão de provar da espada os fios
');

	VALUES (234, 372, TIMESTAMP WITH TIME ZONE '2020-07-12 04:15:01+00', 'Injuriada tem de Roma a f ama,
');
	VALUES (234, 372, TIMESTAMP WITH TIME ZONE '2020-07-12 08:34:27+00', 'Vivem, que antigamente grande guerra
');
	VALUES (234, 228, TIMESTAMP WITH TIME ZONE '2020-07-12 11:33:14+00', 'Disse "pelo Rei novo, Dom João."--
');
	VALUES (234, 372, TIMESTAMP WITH TIME ZONE '2020-07-12 18:11:41+00', 'Vês Cauchichina está, de escura fama,
');

	VALUES (235, 229, TIMESTAMP WITH TIME ZONE '2019-12-01 06:43:20+00', 'Que enquanto Febo, de luz nunca escasso,
');

	VALUES (236, 229, TIMESTAMP WITH TIME ZONE '2020-01-02 02:55:31+00', 'O pomo que da pátria Pérsia veio,
');
	VALUES (236, 229, TIMESTAMP WITH TIME ZONE '2020-01-02 08:02:42+00', 'Tomassem porto, como desejava,
');
	VALUES (236, 229, TIMESTAMP WITH TIME ZONE '2020-01-02 13:16:09+00', 'Se tu pela de Cristo só pelejas?
');
	VALUES (236, 595, TIMESTAMP WITH TIME ZONE '2020-01-02 14:23:50+00', 'E do grão coração que lhe ficara.
');

	VALUES (237, 315, TIMESTAMP WITH TIME ZONE '2020-02-18 05:50:14+00', 'Torna sereno e claro o ar escuro,
');
	VALUES (237, 230, TIMESTAMP WITH TIME ZONE '2020-02-18 08:08:51+00', 'Poder tamanho junto não se viu,
');
	VALUES (237, 315, TIMESTAMP WITH TIME ZONE '2020-02-18 10:06:00+00', 'Para onde sem receio a frota venha;
');
	VALUES (237, 230, TIMESTAMP WITH TIME ZONE '2020-02-18 17:01:48+00', 'Principalmente aqui, que sou chegado
');

	VALUES (238, 230, TIMESTAMP WITH TIME ZONE '2020-01-29 12:32:41+00', 'Em três batéis somente que trazia.
');
	VALUES (238, 696, TIMESTAMP WITH TIME ZONE '2020-01-29 16:38:06+00', 'Quem de uma peregrina formosura,
');

	VALUES (239, 399, TIMESTAMP WITH TIME ZONE '2020-09-28 20:45:18+00', '"Olha aquele que desce pela lança?
');
	VALUES (239, 231, TIMESTAMP WITH TIME ZONE '2020-09-28 23:00:40+00', 'Não há peito tão alto e tão potente,
');

	VALUES (240, 471, TIMESTAMP WITH TIME ZONE '2019-06-08 18:15:04+00', 'Que o Príncipe, a seu mando sometido,
');
	VALUES (240, 232, TIMESTAMP WITH TIME ZONE '2019-06-08 23:39:48+00', 'Que na costa Cambaica, sempre armada,
');
	VALUES (240, 471, TIMESTAMP WITH TIME ZONE '2019-06-09 04:28:37+00', 'Nas Anfióneas Tebas se causaram;
');

	VALUES (241, 232, TIMESTAMP WITH TIME ZONE '2019-05-20 09:20:51+00', 'A derribarem quanto acham diante.
');

	VALUES (242, 437, TIMESTAMP WITH TIME ZONE '2018-11-15 17:38:52+00', 'Ver destruir do Samorim potente,
');
	VALUES (242, 437, TIMESTAMP WITH TIME ZONE '2018-11-15 18:13:57+00', '"Olha este desleal o como paga
');

	VALUES (243, 233, TIMESTAMP WITH TIME ZONE '2020-12-06 23:19:12+00', '"Mas moura enfim nas mãos das brutas gentes,
');
	VALUES (243, 233, TIMESTAMP WITH TIME ZONE '2020-12-06 23:53:41+00', 'Demónios infernais, negros e ardentes,
');
	VALUES (243, 423, TIMESTAMP WITH TIME ZONE '2020-12-07 01:04:53+00', 'Me anda Tétis cercando destas águas."--
');
	VALUES (243, 423, TIMESTAMP WITH TIME ZONE '2020-12-07 02:18:19+00', 'Formosas são algumas e outras feias,
');

	VALUES (244, 401, TIMESTAMP WITH TIME ZONE '2020-09-01 02:04:23+00', 'Nas ribeiras do rio, que manava,
');

	VALUES (245, 235, TIMESTAMP WITH TIME ZONE '2021-02-19 11:01:01+00', 'Que tão diversas partes conquistou;
');
	VALUES (245, 235, TIMESTAMP WITH TIME ZONE '2021-02-19 17:47:36+00', 'Que mostraram na terra Tingitana,
');

	VALUES (246, 235, TIMESTAMP WITH TIME ZONE '2021-02-08 21:48:50+00', 'Os Cicones, e a torra onde se esqueçam
');
	VALUES (246, 235, TIMESTAMP WITH TIME ZONE '2021-02-08 23:31:42+00', 'Que vêm por cima da água Netunina.
');

	VALUES (247, 236, TIMESTAMP WITH TIME ZONE '2020-02-16 04:18:21+00', 'O fiel Egas amo, foi livrado;
');
	VALUES (247, 236, TIMESTAMP WITH TIME ZONE '2020-02-16 08:30:42+00', '"Joane, a quem do peito o esforço cresce,
');

	VALUES (248, 434, TIMESTAMP WITH TIME ZONE '2020-05-06 17:39:52+00', 'De Ninfa que sustente o dum Gigante?
');
	VALUES (248, 238, TIMESTAMP WITH TIME ZONE '2020-05-06 20:39:56+00', 'E quase o Reino todo reformou
');
	VALUES (248, 434, TIMESTAMP WITH TIME ZONE '2020-05-07 00:35:22+00', 'Ouviu-lhe essas palavras piedosas
');

	VALUES (249, 238, TIMESTAMP WITH TIME ZONE '2020-04-17 15:58:49+00', 'Por todo o largo mar e pela terra,
');
	VALUES (249, 238, TIMESTAMP WITH TIME ZONE '2020-04-17 17:29:57+00', 'Tão longe da tua pátria Lusitana?"
');

	VALUES (250, 239, TIMESTAMP WITH TIME ZONE '2018-09-07 23:58:46+00', 'Co''os muros naturais por outra parte;
');
	VALUES (250, 667, TIMESTAMP WITH TIME ZONE '2018-09-08 06:35:17+00', 'Do Sarraceno bárbaro estupendo,
');
	VALUES (250, 239, TIMESTAMP WITH TIME ZONE '2018-09-08 08:01:50+00', 'Quando em Évora a voz de uma menina,
');
	VALUES (250, 239, TIMESTAMP WITH TIME ZONE '2018-09-08 15:07:24+00', '"E não menos de Dio a fera frota,
');

	VALUES (251, 241, TIMESTAMP WITH TIME ZONE '2020-09-30 21:22:04+00', 'Perdendo o esforço veio, e bélica arte;
');
	VALUES (251, 241, TIMESTAMP WITH TIME ZONE '2020-10-01 03:55:46+00', 'Que não sofre a nenhum que o passo mude
');
	VALUES (251, 241, TIMESTAMP WITH TIME ZONE '2020-10-01 11:25:32+00', 'Ali a formosa Deusa lhe aconselha
');
	VALUES (251, 489, TIMESTAMP WITH TIME ZONE '2020-10-01 18:16:37+00', 'Porque já lhe dissera, deste jeito,
');

	VALUES (252, 535, TIMESTAMP WITH TIME ZONE '2020-05-26 12:47:51+00', 'A naufrágios, a pexes, ao profundo.
');
