	VALUES (392, 385, TIMESTAMP WITH TIME ZONE '2020-05-13 19:01:35+00', '"Estes e outros Barões, por várias partes,
');
	VALUES (392, 385, TIMESTAMP WITH TIME ZONE '2020-05-14 01:46:14+00', 'Responde Leonardo, que trazia
');

	VALUES (393, 385, TIMESTAMP WITH TIME ZONE '2021-04-16 01:10:39+00', 'Dali vão em demanda da água pura,
');
	VALUES (393, 385, TIMESTAMP WITH TIME ZONE '2021-04-16 08:16:41+00', 'Onde terá segura a curta vida,
');
	VALUES (393, 501, TIMESTAMP WITH TIME ZONE '2021-04-16 10:02:54+00', 'Receberão de todo o Ilustre os ossos.
');

	VALUES (394, 476, TIMESTAMP WITH TIME ZONE '2019-05-19 22:48:21+00', 'Uns leva a defensão da própria terra,
');
	VALUES (394, 476, TIMESTAMP WITH TIME ZONE '2019-05-20 01:48:06+00', 'Mas o Rei, vendo a estranha lealdade,
');
	VALUES (394, 386, TIMESTAMP WITH TIME ZONE '2019-05-20 03:59:23+00', 'Tomé vinha prègando, e já passara
');

	VALUES (395, 474, TIMESTAMP WITH TIME ZONE '2019-04-21 08:21:10+00', 'Lhe andar armando, que pôr em ventura
');
	VALUES (395, 386, TIMESTAMP WITH TIME ZONE '2019-04-21 09:41:11+00', 'Este tempo passar, que é tão pesado,
');
	VALUES (395, 386, TIMESTAMP WITH TIME ZONE '2019-04-21 14:26:22+00', 'Um ramo por insígnia na direita.
');
	VALUES (395, 386, TIMESTAMP WITH TIME ZONE '2019-04-21 20:17:17+00', 'De temor das Nereidas apressadas.
');

	VALUES (396, 587, TIMESTAMP WITH TIME ZONE '2021-02-23 20:10:07+00', 'A quem juízo algum nunca alcançou!
');
	VALUES (396, 587, TIMESTAMP WITH TIME ZONE '2021-02-23 20:17:28+00', 'Nem sem licença sua ir-se podia,
');
	VALUES (396, 387, TIMESTAMP WITH TIME ZONE '2021-02-23 21:54:40+00', 'Ramos não conhecidos e ervas tinha;
');

	VALUES (397, 388, TIMESTAMP WITH TIME ZONE '2019-09-02 05:55:10+00', 'Destruição de gente, e de valia.
');
	VALUES (397, 492, TIMESTAMP WITH TIME ZONE '2019-09-02 12:19:30+00', '(Nüa cônsona voz todas soavam),
');

	VALUES (398, 434, TIMESTAMP WITH TIME ZONE '2019-12-26 00:25:48+00', 'Vê Catigão, cidade das milhores
');
	VALUES (398, 390, TIMESTAMP WITH TIME ZONE '2019-12-26 04:09:07+00', 'Não sofre amores, nem delicadeza;
');

	VALUES (399, 390, TIMESTAMP WITH TIME ZONE '2019-12-16 14:35:13+00', '"Porém, como a luz crástina chegada
');
	VALUES (399, 403, TIMESTAMP WITH TIME ZONE '2019-12-16 16:15:10+00', 'Com lágrimas correndo piedosas.
');
	VALUES (399, 390, TIMESTAMP WITH TIME ZONE '2019-12-16 17:37:59+00', 'Se terras e riqueza mais desejas?
');
	VALUES (399, 403, TIMESTAMP WITH TIME ZONE '2019-12-16 18:22:38+00', 'Para o pelouro ardente, que assovia
');

	VALUES (400, 664, TIMESTAMP WITH TIME ZONE '2019-03-03 07:05:20+00', 'Nelas estar se deixa descansado.
');
	VALUES (400, 664, TIMESTAMP WITH TIME ZONE '2019-03-03 13:45:59+00', 'E se vier do mar desbaratada,
');
	VALUES (400, 664, TIMESTAMP WITH TIME ZONE '2019-03-03 16:56:11+00', 'Como a Sansão Hebréio da guedelha,
');
	VALUES (400, 391, TIMESTAMP WITH TIME ZONE '2019-03-03 23:13:03+00', 'Chamará o Samorim mais gente nova;
');

	VALUES (401, 392, TIMESTAMP WITH TIME ZONE '2019-05-14 17:54:34+00', 'E de vencidos já desesperados.
');
	VALUES (401, 392, TIMESTAMP WITH TIME ZONE '2019-05-15 00:18:34+00', 'Contra Arronches, que toma, por vingança
');
	VALUES (401, 588, TIMESTAMP WITH TIME ZONE '2019-05-15 06:43:14+00', 'É Teotónio, Prior. Mas vê cercada
');

	VALUES (402, 393, TIMESTAMP WITH TIME ZONE '2020-12-13 21:49:25+00', 'Braços, pernas, sem dono e sem sentido;
');
	VALUES (402, 393, TIMESTAMP WITH TIME ZONE '2020-12-14 02:46:37+00', 'Sem à dita de Aquiles ter enveja.');

	VALUES (403, 393, TIMESTAMP WITH TIME ZONE '2021-01-20 09:13:07+00', 'A vista delas, logo lhe falecem
');
	VALUES (403, 462, TIMESTAMP WITH TIME ZONE '2021-01-20 10:40:07+00', 'Enche as velas da frota belicosa;
');

	VALUES (404, 669, TIMESTAMP WITH TIME ZONE '2020-08-28 10:08:02+00', 'Mas pois saber humano nem prudência
');
	VALUES (404, 394, TIMESTAMP WITH TIME ZONE '2020-08-28 10:40:44+00', 'Toda a terra, que rega o Tejo ameno:
');
	VALUES (404, 394, TIMESTAMP WITH TIME ZONE '2020-08-28 13:08:05+00', 'Por fugir do perigo que se sente,
');

	VALUES (405, 395, TIMESTAMP WITH TIME ZONE '2018-03-18 05:30:01+00', 'Sinal lhe mostra o Demo verdadeiro,
');
	VALUES (405, 419, TIMESTAMP WITH TIME ZONE '2018-03-18 06:42:43+00', 'A povoação, sem muro e sem defesa,
');

	VALUES (406, 396, TIMESTAMP WITH TIME ZONE '2021-03-10 17:48:29+00', 'Entre as gentes deixar de si memória
');

	VALUES (407, 396, TIMESTAMP WITH TIME ZONE '2021-03-15 12:27:13+00', 'Desejoso de ver as coisas grandes,
');
	VALUES (407, 396, TIMESTAMP WITH TIME ZONE '2021-03-15 14:16:32+00', 'Buscas o incerto e incógnito perigo
');

	VALUES (408, 397, TIMESTAMP WITH TIME ZONE '2020-10-22 09:40:36+00', 'Do Tejo, pelo mar que o Gama abrira,
');
	VALUES (408, 397, TIMESTAMP WITH TIME ZONE '2020-10-22 13:40:36+00', 'Se parte diligente da cidade;
');

	VALUES (409, 555, TIMESTAMP WITH TIME ZONE '2019-07-09 00:54:03+00', 'Que ele, nem quem na estirpe seu se chama,
');

	VALUES (410, 578, TIMESTAMP WITH TIME ZONE '2020-10-12 09:59:11+00', 'Ou fazendo que, mais que a de Medusa,
');
	VALUES (410, 399, TIMESTAMP WITH TIME ZONE '2020-10-12 16:17:22+00', '--"Ó maldito o primeiro que no mundo
');
	VALUES (410, 578, TIMESTAMP WITH TIME ZONE '2020-10-12 16:44:36+00', 'E tornemos à costa debuxada.
');
	VALUES (410, 578, TIMESTAMP WITH TIME ZONE '2020-10-12 18:01:09+00', 'Desafios cruéis, pintura fera,
');

	VALUES (411, 470, TIMESTAMP WITH TIME ZONE '2019-02-24 14:46:43+00', 'Ajunta também Mafra, em pouco espaço,
');
	VALUES (411, 400, TIMESTAMP WITH TIME ZONE '2019-02-24 17:56:32+00', 'Que cítara jamais cantou vitória,
');
	VALUES (411, 470, TIMESTAMP WITH TIME ZONE '2019-02-24 20:27:25+00', 'O grão poder de Dário estrui e rende,
');
	VALUES (411, 400, TIMESTAMP WITH TIME ZONE '2019-02-25 03:47:31+00', 'De semear cizânias repugnantes:
');

	VALUES (412, 513, TIMESTAMP WITH TIME ZONE '2020-01-06 20:26:43+00', 'Um mancebo de Assíria, um de Judeia.
');
	VALUES (412, 400, TIMESTAMP WITH TIME ZONE '2020-01-07 02:32:34+00', 'Lá no estelante Olimpo, a quem subia
');
	VALUES (412, 513, TIMESTAMP WITH TIME ZONE '2020-01-07 05:53:02+00', '-"Vedes-me aqui, Rei vosso, e companheiro,
');

	VALUES (413, 401, TIMESTAMP WITH TIME ZONE '2020-08-01 02:24:23+00', '"Eu, que bem mal cuidava que em efeito
');

	VALUES (414, 402, TIMESTAMP WITH TIME ZONE '2021-01-11 03:55:58+00', 'Entre no reino d''água o Rei do vinho.
');
	VALUES (414, 605, TIMESTAMP WITH TIME ZONE '2021-01-11 11:40:57+00', 'De contente de ver que a dama o manda,
');
	VALUES (414, 402, TIMESTAMP WITH TIME ZONE '2021-01-11 19:19:11+00', 'Que a tão altas empresas aspirava,
');

	VALUES (415, 569, TIMESTAMP WITH TIME ZONE '2019-05-20 13:31:17+00', 'Nos seus paços, com festas e alegria;
');
	VALUES (415, 569, TIMESTAMP WITH TIME ZONE '2019-05-20 16:18:07+00', 'No gosto da cobiça e na rudeza
');
	VALUES (415, 569, TIMESTAMP WITH TIME ZONE '2019-05-20 20:07:12+00', 'Daqui e dali saltando, o charco soa,
');
	VALUES (415, 403, TIMESTAMP WITH TIME ZONE '2019-05-21 01:37:52+00', 'Abraçados as almas soltarão
');

	VALUES (416, 403, TIMESTAMP WITH TIME ZONE '2019-01-03 02:47:55+00', 'E se não for contigo socorrido,
');
	VALUES (416, 403, TIMESTAMP WITH TIME ZONE '2019-01-03 08:23:58+00', '"Olha o muro e edifício nunca crido,
');
	VALUES (416, 517, TIMESTAMP WITH TIME ZONE '2019-01-03 13:36:30+00', '"Martim Lopes se chama o cavaleiro,
');
	VALUES (416, 517, TIMESTAMP WITH TIME ZONE '2019-01-03 13:41:49+00', 'O filho de Climene a cor do dia.
');

	VALUES (417, 566, TIMESTAMP WITH TIME ZONE '2020-10-23 12:30:31+00', 'Cavalos, e concertos de mil cores.
');
	VALUES (417, 404, TIMESTAMP WITH TIME ZONE '2020-10-23 17:29:40+00', 'Ou como as naus em fogo lhe abrasasse,
');

	VALUES (418, 413, TIMESTAMP WITH TIME ZONE '2020-11-19 22:43:31+00', 'Mas olha Rui Pereira, que com o rosto
');

	VALUES (419, 433, TIMESTAMP WITH TIME ZONE '2020-10-16 10:12:43+00', 'Do mar a enchente súbita, grandíssima,
');
	VALUES (419, 433, TIMESTAMP WITH TIME ZONE '2020-10-16 11:52:44+00', 'Fora por certo invicto cavaleiro,
');

	VALUES (420, 506, TIMESTAMP WITH TIME ZONE '2018-10-05 19:34:32+00', 'Possa a terra mandar qualquer fazenda,
');

	VALUES (421, 636, TIMESTAMP WITH TIME ZONE '2021-01-22 16:03:40+00', 'Mas de vias tão ásperas, tamanhas,
');
	VALUES (421, 636, TIMESTAMP WITH TIME ZONE '2021-01-22 19:04:16+00', 'Que em lança de aço torna o Bago de ouro.
');

	VALUES (422, 407, TIMESTAMP WITH TIME ZONE '2020-05-23 09:35:05+00', 'Do Sul e regiões de abrigo nuas;
');
	VALUES (422, 679, TIMESTAMP WITH TIME ZONE '2020-05-23 15:56:49+00', 'E do Orionte o gesto turbulento;
');
	VALUES (422, 679, TIMESTAMP WITH TIME ZONE '2020-05-23 22:31:42+00', 'Co''os anafis os Mouros respondiam.
');
	VALUES (422, 407, TIMESTAMP WITH TIME ZONE '2020-05-24 01:07:35+00', 'Por que somos de ti desamparados,
');

	VALUES (423, 407, TIMESTAMP WITH TIME ZONE '2020-05-17 17:19:39+00', 'Tomé vinha prègando, e já passara
');
	VALUES (423, 627, TIMESTAMP WITH TIME ZONE '2020-05-18 00:59:32+00', 'Da gente que vem ver a leda armada,
');

	VALUES (424, 498, TIMESTAMP WITH TIME ZONE '2020-01-13 01:42:14+00', 'Com o Capitão, e não com o Mauro engano.
');
	VALUES (424, 498, TIMESTAMP WITH TIME ZONE '2020-01-13 09:22:23+00', 'Que tão queridos tinha, e tão mimosos,
');
	VALUES (424, 498, TIMESTAMP WITH TIME ZONE '2020-01-13 15:23:50+00', 'Por ela abaixo um pouco navegamos,
');
	VALUES (424, 498, TIMESTAMP WITH TIME ZONE '2020-01-13 17:36:53+00', 'Faz escudo às galés, diante posto.
');

	VALUES (425, 601, TIMESTAMP WITH TIME ZONE '2020-04-05 19:56:54+00', 'Ou parecerão fábulas sonhadas,
');

	VALUES (426, 651, TIMESTAMP WITH TIME ZONE '2019-10-16 03:30:10+00', 'Tudo provê com ânimo e prudência;
');
	VALUES (426, 651, TIMESTAMP WITH TIME ZONE '2019-10-16 04:38:33+00', 'Há-de ser Dom Cristóvão o nome seu;
');

	VALUES (427, 619, TIMESTAMP WITH TIME ZONE '2020-09-25 11:42:18+00', 'Se houve feitos no mundo tão possantes,
');
	VALUES (427, 619, TIMESTAMP WITH TIME ZONE '2020-09-25 19:12:26+00', 'Com isto o nobre Gama recebia
');
	VALUES (427, 414, TIMESTAMP WITH TIME ZONE '2020-09-26 01:59:05+00', 'Antes, sendo esta sua, se esquecera
');

	VALUES (428, 414, TIMESTAMP WITH TIME ZONE '2020-09-16 09:43:19+00', 'Não menos suas terras mal sustenta
');
	VALUES (428, 662, TIMESTAMP WITH TIME ZONE '2020-09-16 13:14:57+00', 'Ora fogem do Centro longamente,
');
	VALUES (428, 662, TIMESTAMP WITH TIME ZONE '2020-09-16 16:17:53+00', 'Pisando o cristalino Céu formoso,
');
	VALUES (428, 414, TIMESTAMP WITH TIME ZONE '2020-09-16 18:00:21+00', 'Lágrimas são de míseros amantes;
');

	VALUES (429, 416, TIMESTAMP WITH TIME ZONE '2020-04-18 23:18:36+00', 'Porque a gente marítima e a de Marte
');
	VALUES (429, 416, TIMESTAMP WITH TIME ZONE '2020-04-19 05:27:25+00', 'E do arco, que os cornos arremeda
');
	VALUES (429, 416, TIMESTAMP WITH TIME ZONE '2020-04-19 07:10:02+00', 'Mas alembrou-lhe üa ira que o condena,
');

	VALUES (430, 645, TIMESTAMP WITH TIME ZONE '2020-11-02 16:07:12+00', 'De áspero mato e de espessura brava.
');
	VALUES (430, 417, TIMESTAMP WITH TIME ZONE '2020-11-02 16:28:32+00', 'Neste tempo, que as âncoras levavam,
');

	VALUES (431, 417, TIMESTAMP WITH TIME ZONE '2020-03-05 18:28:31+00', '"Deixamos de Massília a estéril costa,
');
	VALUES (431, 417, TIMESTAMP WITH TIME ZONE '2020-03-05 19:20:40+00', 'Que eles sós poderiam, se não erro,
');
	VALUES (431, 417, TIMESTAMP WITH TIME ZONE '2020-03-05 21:03:19+00', 'No rosto traz, descia diligente.
');
	VALUES (431, 491, TIMESTAMP WITH TIME ZONE '2020-03-06 04:17:38+00', 'Ao Gentio, que os ídolos adora,
');

	VALUES (432, 678, TIMESTAMP WITH TIME ZONE '2020-11-01 01:08:34+00', '--"Ó glória de mandar! Ó vã cobiça
');
	VALUES (432, 418, TIMESTAMP WITH TIME ZONE '2020-11-01 01:29:30+00', 'De seu Rei, tinha já por regimento
');
	VALUES (432, 678, TIMESTAMP WITH TIME ZONE '2020-11-01 06:46:05+00', 'Que sempre os guia já de longos anos;
');

	VALUES (433, 418, TIMESTAMP WITH TIME ZONE '2020-03-07 19:46:00+00', 'Da madre Tethys, qual pirata inico,
');
	VALUES (433, 662, TIMESTAMP WITH TIME ZONE '2020-03-07 19:55:07+00', 'Tethys todo o cerúleo senhorio
');

	VALUES (434, 419, TIMESTAMP WITH TIME ZONE '2021-01-26 16:16:22+00', 'Pelas argênteas ondas Neptuninas,
');
	VALUES (434, 419, TIMESTAMP WITH TIME ZONE '2021-01-26 20:01:13+00', 'Qual Austro fero, ou Bóreas na espessura
');
	VALUES (434, 419, TIMESTAMP WITH TIME ZONE '2021-01-26 23:01:11+00', 'Que dum fio pendia tão delgado
');

	VALUES (435, 421, TIMESTAMP WITH TIME ZONE '2019-03-05 20:43:26+00', 'Se também com tais obras nos engana
');
	VALUES (435, 421, TIMESTAMP WITH TIME ZONE '2019-03-05 21:28:38+00', 'O velho Afonso, Príncipe subido,
');

	VALUES (436, 421, TIMESTAMP WITH TIME ZONE '2019-03-28 09:22:30+00', 'Ambos são de valia e de conselho,
');

	VALUES (437, 422, TIMESTAMP WITH TIME ZONE '2019-08-30 20:53:24+00', 'Vão da morte as exéquias celebrando,
');

	VALUES (438, 423, TIMESTAMP WITH TIME ZONE '2020-11-18 18:28:03+00', 'Da Germânica armada que passava,
');
	VALUES (438, 652, TIMESTAMP WITH TIME ZONE '2020-11-19 01:56:29+00', 'As árvores verás do cravo ardente,
');
	VALUES (438, 423, TIMESTAMP WITH TIME ZONE '2020-11-19 07:30:53+00', 'Faria tremular e pôr espanto
');

	VALUES (439, 436, TIMESTAMP WITH TIME ZONE '2020-12-13 07:29:34+00', 'Lhe pede que não f aça tal desvio
');

	VALUES (440, 424, TIMESTAMP WITH TIME ZONE '2019-01-23 02:25:01+00', 'Porque sempre por via irá direita
');
	VALUES (440, 424, TIMESTAMP WITH TIME ZONE '2019-01-23 07:46:37+00', 'Tem o Galego cauto, e o grande e raro
');
	VALUES (440, 424, TIMESTAMP WITH TIME ZONE '2019-01-23 12:25:45+00', 'Daqui e dali saltando, o charco soa,
');
	VALUES (440, 672, TIMESTAMP WITH TIME ZONE '2019-01-23 15:46:52+00', 'Um sucesso, que triste e negro vejo!
');

	VALUES (441, 654, TIMESTAMP WITH TIME ZONE '2020-07-06 04:34:08+00', 'Na costa de Etiópia, nome antigo,
');
	VALUES (441, 424, TIMESTAMP WITH TIME ZONE '2020-07-06 05:16:21+00', 'Mas antes descansar me deixaria
');
	VALUES (441, 424, TIMESTAMP WITH TIME ZONE '2020-07-06 11:43:37+00', 'Nascem amores mil desconcertados
');
	VALUES (441, 424, TIMESTAMP WITH TIME ZONE '2020-07-06 19:34:03+00', 'Acudo eu logo, e enquanto o remo aperto,
');

	VALUES (442, 426, TIMESTAMP WITH TIME ZONE '2020-08-02 04:56:19+00', 'A Castela, onde o preço sós levaram
');
	VALUES (442, 426, TIMESTAMP WITH TIME ZONE '2020-08-02 12:19:43+00', 'Quando a cidade entrada se rendera
');
	VALUES (442, 426, TIMESTAMP WITH TIME ZONE '2020-08-02 19:39:20+00', 'Da falta deles, logo entre os melhores
');
	VALUES (442, 426, TIMESTAMP WITH TIME ZONE '2020-08-02 21:46:16+00', 'Tu só de mi só foges na espessura?
');

	VALUES (443, 556, TIMESTAMP WITH TIME ZONE '2021-01-17 21:17:32+00', 'Guarda-lhe por entanto um falso Rei
');
	VALUES (443, 426, TIMESTAMP WITH TIME ZONE '2021-01-18 02:20:12+00', 'Com fama grande e nome alto e subido.
');
	VALUES (443, 556, TIMESTAMP WITH TIME ZONE '2021-01-18 04:44:55+00', 'Nas mostras e no gesto o não mostrou;
');

	VALUES (444, 427, TIMESTAMP WITH TIME ZONE '2019-07-25 10:15:03+00', 'Que alqueires três de anéis dos mortos toma.
');
	VALUES (444, 427, TIMESTAMP WITH TIME ZONE '2019-07-25 15:44:15+00', 'Outra pelas batalhas sanguinosas;
');

	VALUES (445, 562, TIMESTAMP WITH TIME ZONE '2020-08-12 11:44:51+00', 'E deixado em ajuda do gentio Rei de
');
	VALUES (445, 427, TIMESTAMP WITH TIME ZONE '2020-08-12 14:22:32+00', 'Invejoso vereis o grão Mavorte
');

	VALUES (446, 536, TIMESTAMP WITH TIME ZONE '2019-05-14 03:01:47+00', 'Do mar incerto, tímidos e ledos;
');
	VALUES (446, 428, TIMESTAMP WITH TIME ZONE '2019-05-14 06:59:31+00', 'Que está com luz tão clara radiando
');
	VALUES (446, 428, TIMESTAMP WITH TIME ZONE '2019-05-14 07:54:34+00', '"Dizem que desta terra co as possantes
');

	VALUES (447, 668, TIMESTAMP WITH TIME ZONE '2021-04-02 20:47:03+00', 'Quando co''os inimigos pelejavam.
');
	VALUES (447, 668, TIMESTAMP WITH TIME ZONE '2021-04-02 23:19:02+00', 'Me respondeu, com voz pesada e amara,
');
	VALUES (447, 668, TIMESTAMP WITH TIME ZONE '2021-04-03 07:00:08+00', 'No mar Índico, e cercam todo o peso
');

	VALUES (448, 467, TIMESTAMP WITH TIME ZONE '2021-04-19 09:40:53+00', 'Que habitam estas úmidas deidades.
');

	VALUES (449, 526, TIMESTAMP WITH TIME ZONE '2021-01-27 21:07:25+00', 'No reino da seca Ádem, que confina
');
	VALUES (449, 526, TIMESTAMP WITH TIME ZONE '2021-01-28 02:17:03+00', 'Ser esta vida cousa tão pequena.
');
	VALUES (449, 526, TIMESTAMP WITH TIME ZONE '2021-01-28 07:03:36+00', 'Louva o Rei o sublime coração
');
	VALUES (449, 526, TIMESTAMP WITH TIME ZONE '2021-01-28 14:10:09+00', 'Armas não deixarão, enquanto a vida
');

	VALUES (450, 609, TIMESTAMP WITH TIME ZONE '2020-05-23 05:32:33+00', 'A frota de seu Rei, que tem segura.
');
	VALUES (450, 609, TIMESTAMP WITH TIME ZONE '2020-05-23 11:25:22+00', '"Deixo, Deuses, atrás a fama antiga,
');
	VALUES (450, 609, TIMESTAMP WITH TIME ZONE '2020-05-23 16:50:20+00', '"Também movem da guerra as negras fúrias
');

	VALUES (451, 649, TIMESTAMP WITH TIME ZONE '2021-01-31 05:05:58+00', 'Da mágoa e da desonra ali passada,
');
	VALUES (451, 649, TIMESTAMP WITH TIME ZONE '2021-01-31 05:48:19+00', 'Que tu fazes, fizerem de atrevidas,
');
	VALUES (451, 434, TIMESTAMP WITH TIME ZONE '2021-01-31 11:08:29+00', 'Tu deves de ir também co''os teus armado
');
	VALUES (451, 434, TIMESTAMP WITH TIME ZONE '2021-01-31 12:32:15+00', 'Quando os Deuses por ordem respondendo,
');

	VALUES (452, 434, TIMESTAMP WITH TIME ZONE '2021-04-18 02:27:53+00', 'Os naturais o têm por cousa santa,
');
	VALUES (452, 501, TIMESTAMP WITH TIME ZONE '2021-04-18 08:40:01+00', 'Do sumo sacerdócio a dignidade,
');

	VALUES (453, 632, TIMESTAMP WITH TIME ZONE '2020-01-13 17:03:34+00', '"E porque é, de vassalos o exercício,
');

	VALUES (454, 436, TIMESTAMP WITH TIME ZONE '2021-05-17 23:02:37+00', 'Nem Atila, que Itália toda espanta,
');

	VALUES (455, 436, TIMESTAMP WITH TIME ZONE '2020-03-18 00:08:40+00', 'O mortífero engano, obediente
');
	VALUES (455, 436, TIMESTAMP WITH TIME ZONE '2020-03-18 06:52:44+00', 'De aumento da pequena Cristandade;
');

	VALUES (456, 437, TIMESTAMP WITH TIME ZONE '2020-04-30 10:18:04+00', 'Os fortes Portugueses, que navegam.
');
	VALUES (456, 437, TIMESTAMP WITH TIME ZONE '2020-04-30 17:42:23+00', 'Quem foi seu matador, e será crido
');
	VALUES (456, 437, TIMESTAMP WITH TIME ZONE '2020-05-01 00:25:53+00', 'Nem violento estupro em virgem pura,
');
	VALUES (456, 437, TIMESTAMP WITH TIME ZONE '2020-05-01 04:54:38+00', 'O Regedor daquela iníqua terra,
');

	VALUES (457, 438, TIMESTAMP WITH TIME ZONE '2020-10-24 11:14:27+00', 'Para a grande viagem prolongada,
');

	VALUES (458, 438, TIMESTAMP WITH TIME ZONE '2019-11-25 14:27:16+00', '"E se queres com pactos e alianças
');
	VALUES (458, 676, TIMESTAMP WITH TIME ZONE '2019-11-25 22:05:53+00', 'Lhe estava o Deus Noturno a porta abrindo,
');
	VALUES (458, 438, TIMESTAMP WITH TIME ZONE '2019-11-25 22:25:06+00', 'Curso verás, nuns grave e noutros leve;
');
	VALUES (458, 676, TIMESTAMP WITH TIME ZONE '2019-11-26 02:34:27+00', '"Que, se aqui a razão se não mostrasse
');

	VALUES (459, 493, TIMESTAMP WITH TIME ZONE '2020-09-30 21:47:01+00', 'Ganges vem ao salgado senhorio;
');
	VALUES (459, 493, TIMESTAMP WITH TIME ZONE '2020-09-30 22:40:16+00', 'E como quem não era já noviço
');

	VALUES (460, 439, TIMESTAMP WITH TIME ZONE '2019-08-09 05:58:42+00', 'Que competia Cloris com Pomona.
');
	VALUES (460, 439, TIMESTAMP WITH TIME ZONE '2019-08-09 10:14:02+00', 'A Factôntea morte chorou tanto.
');

	VALUES (461, 443, TIMESTAMP WITH TIME ZONE '2021-02-04 07:14:57+00', '"E nestes cinco escudos pinta os trinta
');

	VALUES (462, 646, TIMESTAMP WITH TIME ZONE '2018-03-17 00:18:57+00', 'Por estes vos darei um Nuno fero,
');
	VALUES (462, 646, TIMESTAMP WITH TIME ZONE '2018-03-17 07:27:23+00', 'De África as terras, e do Oriente os marços,
');

	VALUES (463, 464, TIMESTAMP WITH TIME ZONE '2020-02-16 21:55:15+00', 'Por defender sua terra amedrontada,
');
	VALUES (463, 464, TIMESTAMP WITH TIME ZONE '2020-02-17 00:17:43+00', 'Pera teus inimigos confessarem
');
	VALUES (463, 464, TIMESTAMP WITH TIME ZONE '2020-02-17 05:33:10+00', 'Me anda Tétis cercando destas águas."--
');
	VALUES (463, 464, TIMESTAMP WITH TIME ZONE '2020-02-17 13:28:17+00', 'Lhe oferece, em que vá, costume usado,
');

	VALUES (464, 476, TIMESTAMP WITH TIME ZONE '2020-01-03 01:39:30+00', 'Português de nação, como conquista
');
	VALUES (464, 476, TIMESTAMP WITH TIME ZONE '2020-01-03 07:19:34+00', '--"Abrindo, lhe responde, o mar profundo,
');
	VALUES (464, 476, TIMESTAMP WITH TIME ZONE '2020-01-03 11:45:48+00', 'É não se ver prezado o verso e rima,
');

	VALUES (465, 448, TIMESTAMP WITH TIME ZONE '2020-01-04 12:34:40+00', 'Podendo o temor mais, gelado, inerte,
');

	VALUES (466, 677, TIMESTAMP WITH TIME ZONE '2021-03-24 21:42:29+00', 'Ordena como em tudo se resista,
');
	VALUES (466, 677, TIMESTAMP WITH TIME ZONE '2021-03-25 04:42:08+00', '"E assim também nos conta dos rodeios
');
	VALUES (466, 677, TIMESTAMP WITH TIME ZONE '2021-03-25 08:33:46+00', 'Que com armas virá despois de ti,
');

	VALUES (467, 449, TIMESTAMP WITH TIME ZONE '2019-07-24 23:13:09+00', 'Ou nos amostra a terra que buscamos,
');

	VALUES (468, 450, TIMESTAMP WITH TIME ZONE '2020-09-01 01:14:49+00', 'Sendo estes que fizeram tanto abalo
');

	VALUES (469, 675, TIMESTAMP WITH TIME ZONE '2019-11-11 13:35:42+00', 'Não quer que tanto tempo se releve
');
	VALUES (469, 675, TIMESTAMP WITH TIME ZONE '2019-11-11 21:01:26+00', '"Se quem com tanto esforço em Deus se atreve,
');
	VALUES (469, 451, TIMESTAMP WITH TIME ZONE '2019-11-12 03:31:34+00', 'Nos muros de Bizâncio e de Turquia.
');

	VALUES (470, 634, TIMESTAMP WITH TIME ZONE '2020-05-11 10:46:20+00', 'Dele num caso grande, em recompensa.
');

	VALUES (471, 452, TIMESTAMP WITH TIME ZONE '2020-03-13 01:33:38+00', 'De rogarem, por vosso regimento,
');

	VALUES (472, 557, TIMESTAMP WITH TIME ZONE '2020-04-06 04:22:37+00', 'Põe no cepo a garganta, e já entregado
');

	VALUES (473, 669, TIMESTAMP WITH TIME ZONE '2020-06-22 20:07:45+00', 'Julga qualquer juízo sossegado
');

	VALUES (474, 580, TIMESTAMP WITH TIME ZONE '2020-09-01 10:41:45+00', 'Suas mercadorias ricas mande.
');
	VALUES (474, 580, TIMESTAMP WITH TIME ZONE '2020-09-01 12:19:06+00', 'Chama aquele remédio santo é forte,
');

	VALUES (475, 506, TIMESTAMP WITH TIME ZONE '2018-11-09 13:04:50+00', 'Aquele que criou todo o Hemisfério,
');
	VALUES (475, 506, TIMESTAMP WITH TIME ZONE '2018-11-09 13:08:38+00', 'Para lá se inclinava a leda frota;
');

	VALUES (476, 456, TIMESTAMP WITH TIME ZONE '2021-03-02 15:16:58+00', 'Esta, o velho que os filhos próprios come
');
	VALUES (476, 456, TIMESTAMP WITH TIME ZONE '2021-03-02 18:36:04+00', 'Por nós, da mesma já contada gente,
');

	VALUES (477, 456, TIMESTAMP WITH TIME ZONE '2021-02-28 01:59:11+00', 'Recolheu logo a Ninfa a clara história.
');
	VALUES (477, 456, TIMESTAMP WITH TIME ZONE '2021-02-28 07:16:25+00', 'Lá no seio Eritreu, onde fundada
');
	VALUES (477, 456, TIMESTAMP WITH TIME ZONE '2021-02-28 09:06:26+00', 'Com que também do campo a cor se perde,
');
	VALUES (477, 657, TIMESTAMP WITH TIME ZONE '2021-02-28 13:43:40+00', 'Que de outrem, quem mandava, era mandado.
');

	VALUES (478, 458, TIMESTAMP WITH TIME ZONE '2020-07-17 15:27:09+00', 'Súbitas trovoadas temerosas,
');

	VALUES (479, 458, TIMESTAMP WITH TIME ZONE '2020-11-24 07:40:22+00', 'Cometam o Pacheco, que tem asas,
');
	VALUES (479, 458, TIMESTAMP WITH TIME ZONE '2020-11-24 09:40:11+00', 'Que pelejando está co''o Mauritano.
');

	VALUES (480, 459, TIMESTAMP WITH TIME ZONE '2020-07-26 03:00:47+00', 'O Capitão, que em tudo o Mouro cria,
');

	VALUES (481, 521, TIMESTAMP WITH TIME ZONE '2018-11-07 06:12:25+00', 'Nem tanto o grã Tonante arremessou
');
	VALUES (481, 521, TIMESTAMP WITH TIME ZONE '2018-11-07 09:16:18+00', 'O Gama e Portugueses no aposento
');

	VALUES (482, 539, TIMESTAMP WITH TIME ZONE '2019-06-18 18:50:12+00', 'Triunfando, nos céus, com justa palma.
');
	VALUES (482, 539, TIMESTAMP WITH TIME ZONE '2019-06-18 20:36:32+00', 'Via estar todo o Céu determinado
');
	VALUES (482, 460, TIMESTAMP WITH TIME ZONE '2019-06-19 02:16:21+00', 'Destarte para o Rei de longe brada:
');

	VALUES (483, 461, TIMESTAMP WITH TIME ZONE '2021-02-17 13:12:45+00', 'Por nos não magoarmos, ou mudarmos
');
	VALUES (483, 461, TIMESTAMP WITH TIME ZONE '2021-02-17 14:03:45+00', 'Que possuí-los sem os merecer.
');
	VALUES (483, 523, TIMESTAMP WITH TIME ZONE '2021-02-17 20:09:43+00', 'Com lhe deixar descansos corruptores.
');
	VALUES (483, 523, TIMESTAMP WITH TIME ZONE '2021-02-18 01:24:18+00', 'Vão-se às praias de Rodes arenosas;
');

	VALUES (484, 554, TIMESTAMP WITH TIME ZONE '2021-03-27 04:09:14+00', 'Tal determinação levar avante,
');

	VALUES (485, 463, TIMESTAMP WITH TIME ZONE '2021-05-13 12:54:45+00', 'Despois a ser vencido dele venha
');
	VALUES (485, 604, TIMESTAMP WITH TIME ZONE '2021-05-13 15:19:23+00', 'Pêro Rodrigues é do Landroal.
');
	VALUES (485, 604, TIMESTAMP WITH TIME ZONE '2021-05-13 18:37:14+00', 'Que no mar nasce, e Arábia em cheiro passa.
');
	VALUES (485, 604, TIMESTAMP WITH TIME ZONE '2021-05-13 23:39:58+00', 'Desistir-se da cousa começada.
');

	VALUES (486, 555, TIMESTAMP WITH TIME ZONE '2019-07-20 10:19:41+00', 'Corruptos pela Maumetana gente,
');
	VALUES (486, 555, TIMESTAMP WITH TIME ZONE '2019-07-20 14:19:50+00', 'Dos Apolíneos raios, eu te fico
');

	VALUES (487, 566, TIMESTAMP WITH TIME ZONE '2018-11-06 01:38:22+00', 'Da primeira marítima vitória.
');

	VALUES (488, 601, TIMESTAMP WITH TIME ZONE '2020-04-04 12:30:04+00', 'Com cujo braço o Mouro inimigo doma,
');
	VALUES (488, 601, TIMESTAMP WITH TIME ZONE '2020-04-04 12:44:06+00', '"Virá despois Meneses, cujo ferro
');
	VALUES (488, 601, TIMESTAMP WITH TIME ZONE '2020-04-04 14:45:09+00', 'Deitando-o de si fora, e lá na ardente
');
	VALUES (488, 467, TIMESTAMP WITH TIME ZONE '2020-04-04 14:59:29+00', 'No Santo dá, já a tudo oferecido;
');

	VALUES (489, 469, TIMESTAMP WITH TIME ZONE '2019-09-04 18:43:34+00', 'Tenham Religiosos exercícios
');
	VALUES (489, 608, TIMESTAMP WITH TIME ZONE '2019-09-04 21:31:35+00', 'E trazem já de longe engano urdido
');
	VALUES (489, 469, TIMESTAMP WITH TIME ZONE '2019-09-05 01:57:16+00', 'Com enganosa e grande cortesia,
');
	VALUES (489, 469, TIMESTAMP WITH TIME ZONE '2019-09-05 06:08:16+00', 'Com que, com minha honra, escuse o dano."
');

	VALUES (490, 469, TIMESTAMP WITH TIME ZONE '2019-09-17 03:03:27+00', 'Que tanto mar e terras tem passadas.
');
	VALUES (490, 656, TIMESTAMP WITH TIME ZONE '2019-09-17 09:26:11+00', 'Dos vestidos, olhados juntamente,
');
	VALUES (490, 469, TIMESTAMP WITH TIME ZONE '2019-09-17 09:40:20+00', 'Quedas coas duras armas, tudo atroam;
');
	VALUES (490, 469, TIMESTAMP WITH TIME ZONE '2019-09-17 12:58:58+00', 'De Marrocos o Rei comete e ofende.
');

	VALUES (491, 471, TIMESTAMP WITH TIME ZONE '2019-02-05 07:57:33+00', 'Na geração de Adão, coa falsidade,
');
	VALUES (491, 471, TIMESTAMP WITH TIME ZONE '2019-02-05 12:47:59+00', 'Cantem, louvem e escrevam sempre extremos
');
	VALUES (491, 557, TIMESTAMP WITH TIME ZONE '2019-02-05 20:34:13+00', 'Destruídos, ou mortos totalmente
');

	VALUES (492, 674, TIMESTAMP WITH TIME ZONE '2019-02-11 02:29:10+00', 'Vinham a ele e à morte oferecer-se.
');

	VALUES (493, 629, TIMESTAMP WITH TIME ZONE '2020-05-10 09:09:27+00', 'Nem vendo-se num cerco duro e urgente.
');
	VALUES (493, 472, TIMESTAMP WITH TIME ZONE '2020-05-10 15:51:47+00', '"Quem viu um olhar seguro, um gesto brando,
');

	VALUES (494, 472, TIMESTAMP WITH TIME ZONE '2020-07-04 22:39:27+00', 'Tão formosa no gesto se mostrava,
');

	VALUES (495, 474, TIMESTAMP WITH TIME ZONE '2019-04-12 18:56:49+00', 'Mas a militar arte e engenho logo
');
	VALUES (495, 611, TIMESTAMP WITH TIME ZONE '2019-04-12 20:06:12+00', 'Aos brados o razões do Capitão
');
	VALUES (495, 474, TIMESTAMP WITH TIME ZONE '2019-04-13 01:32:03+00', '"Nestas e outras palavras que diziam
');
	VALUES (495, 611, TIMESTAMP WITH TIME ZONE '2019-04-13 05:40:04+00', 'Dos imigos, gritando o céu tocavam,
');

	VALUES (496, 504, TIMESTAMP WITH TIME ZONE '2020-06-19 07:21:33+00', 'Corre Orixa, de roupas abastada;
');
	VALUES (496, 475, TIMESTAMP WITH TIME ZONE '2020-06-19 12:10:51+00', 'Julgando as cousas só pela aparência,
');
	VALUES (496, 475, TIMESTAMP WITH TIME ZONE '2020-06-19 12:18:54+00', 'Lhe mandava a caríssima consorte,
');

	VALUES (497, 475, TIMESTAMP WITH TIME ZONE '2020-06-07 00:45:51+00', 'Escreve a seu irmão que lhe mandasse
');
	VALUES (497, 615, TIMESTAMP WITH TIME ZONE '2020-06-07 05:28:23+00', 'Já vinham pelas ruas caminhando,
');
	VALUES (497, 475, TIMESTAMP WITH TIME ZONE '2020-06-07 07:15:24+00', 'E que mimoso choro que soava!
');
	VALUES (497, 615, TIMESTAMP WITH TIME ZONE '2020-06-07 09:31:22+00', 'Convoca as alvas filhas de Nereu,
');

	VALUES (498, 476, TIMESTAMP WITH TIME ZONE '2019-06-09 12:17:05+00', 'Que na de ferro e d''armas te deitou:
');

	VALUES (499, 476, TIMESTAMP WITH TIME ZONE '2021-04-22 11:52:24+00', 'A qual se o Céu me dá que eu sem perigo
');
	VALUES (499, 476, TIMESTAMP WITH TIME ZONE '2021-04-22 12:26:12+00', 'O mais cheiroso incenso pera as aras;
');
	VALUES (499, 476, TIMESTAMP WITH TIME ZONE '2021-04-22 18:32:23+00', 'E enquanto isto só na alma imaginava,
');
	VALUES (499, 604, TIMESTAMP WITH TIME ZONE '2021-04-23 02:21:49+00', 'Puseste nome esforço e valentia,
');

	VALUES (500, 478, TIMESTAMP WITH TIME ZONE '2020-07-19 16:40:10+00', '"A um Cochim, e a outro Cananor,
');
	VALUES (500, 570, TIMESTAMP WITH TIME ZONE '2020-07-19 23:28:34+00', 'E agora Guardafú, dos moradores,
');
	VALUES (500, 478, TIMESTAMP WITH TIME ZONE '2020-07-20 00:10:12+00', 'Contra vontade sua, e não rogando.
');

	VALUES (501, 620, TIMESTAMP WITH TIME ZONE '2020-09-16 22:45:12+00', 'Com todas juntamente se partia,
');
	VALUES (501, 479, TIMESTAMP WITH TIME ZONE '2020-09-17 03:29:17+00', 'Portuguesa inflamados, levantavam
');
	VALUES (501, 620, TIMESTAMP WITH TIME ZONE '2020-09-17 06:21:20+00', 'De afeição em Monçaide, que guardado
');
	VALUES (501, 479, TIMESTAMP WITH TIME ZONE '2020-09-17 10:00:13+00', 'Só pode o que impossível parecia:
');

	VALUES (502, 481, TIMESTAMP WITH TIME ZONE '2019-08-28 00:41:46+00', 'Foi nas forças Caudinas, de ignorante,
');
	VALUES (502, 695, TIMESTAMP WITH TIME ZONE '2019-08-28 06:49:15+00', 'Espanha, França, Itália celebrada,
');
	VALUES (502, 481, TIMESTAMP WITH TIME ZONE '2019-08-28 08:07:13+00', 'Da boca do facundo Capitão
');
	VALUES (502, 695, TIMESTAMP WITH TIME ZONE '2019-08-28 11:18:53+00', 'O Gentio os combates, apressado,
');

	VALUES (503, 482, TIMESTAMP WITH TIME ZONE '2020-01-25 16:19:43+00', 'Olha a Carreta, atenta a Cinosura,
');
	VALUES (503, 482, TIMESTAMP WITH TIME ZONE '2020-01-25 20:24:30+00', 'Não pode ter subido pensamento.
');
	VALUES (503, 482, TIMESTAMP WITH TIME ZONE '2020-01-25 23:15:28+00', 'Das filhas de Nereu acompanhada,
');
	VALUES (503, 482, TIMESTAMP WITH TIME ZONE '2020-01-26 05:58:24+00', 'Da vária cor que pinta o roxo fruto;
');

	VALUES (504, 523, TIMESTAMP WITH TIME ZONE '2019-12-01 11:03:47+00', 'Tanto que à nova terra se chegaram,
');
	VALUES (504, 483, TIMESTAMP WITH TIME ZONE '2019-12-01 17:13:14+00', 'Do Mouro ali verão que a voz extrema
');
	VALUES (504, 483, TIMESTAMP WITH TIME ZONE '2019-12-01 23:48:31+00', 'Cujo pomo contra o veneno urgente
');

	VALUES (505, 489, TIMESTAMP WITH TIME ZONE '2020-08-30 12:06:52+00', 'Sendo todos de um ventre produzidos?
');
	VALUES (505, 486, TIMESTAMP WITH TIME ZONE '2020-08-30 17:17:07+00', 'Descer às sombras nuas já passadas:
');

	VALUES (506, 486, TIMESTAMP WITH TIME ZONE '2020-02-21 09:34:08+00', 'Que competia Cloris com Pomona.
');
	VALUES (506, 545, TIMESTAMP WITH TIME ZONE '2020-02-21 11:39:50+00', 'Co''os sucessos das guerras do começo,
');
	VALUES (506, 486, TIMESTAMP WITH TIME ZONE '2020-02-21 19:17:49+00', 'Por manha da Rainha que, inventando
');

	VALUES (507, 587, TIMESTAMP WITH TIME ZONE '2021-03-05 02:30:49+00', 'Vá sem perigo a frota, não temendo,
');
	VALUES (507, 487, TIMESTAMP WITH TIME ZONE '2021-03-05 07:27:26+00', 'Leves embarcações de pescadores
');
	VALUES (507, 587, TIMESTAMP WITH TIME ZONE '2021-03-05 11:35:40+00', 'Nem as filhas do Tejo, que deixassem
');

	VALUES (508, 488, TIMESTAMP WITH TIME ZONE '2020-08-11 12:39:51+00', 'Me será sempre o mil a que se atreve."
');
	VALUES (508, 680, TIMESTAMP WITH TIME ZONE '2020-08-11 15:32:23+00', 'Mas neste caso a última tenção
');
	VALUES (508, 488, TIMESTAMP WITH TIME ZONE '2020-08-11 19:45:31+00', 'O Sol, logo em nascendo, vê primeiro;
');

	VALUES (509, 579, TIMESTAMP WITH TIME ZONE '2020-06-25 06:30:10+00', 'Vede, Ninfas, que engenhos de senhores
');
	VALUES (509, 488, TIMESTAMP WITH TIME ZONE '2020-06-25 09:02:22+00', '"Que o grã Senhor e Fados que destinam,
');
	VALUES (509, 579, TIMESTAMP WITH TIME ZONE '2020-06-25 12:56:06+00', '"A muitos mandam ver o Estígio lago,
');

	VALUES (510, 489, TIMESTAMP WITH TIME ZONE '2020-09-19 19:22:17+00', 'Com ofertas depois, e romarias,
');

	VALUES (511, 489, TIMESTAMP WITH TIME ZONE '2020-09-22 07:12:52+00', 'O quarto e quinto Afonsos, e o terceiro.
');

	VALUES (512, 620, TIMESTAMP WITH TIME ZONE '2020-09-11 13:56:51+00', 'Estrangeiros na terra, Lei e nação;
');
	VALUES (512, 620, TIMESTAMP WITH TIME ZONE '2020-09-11 15:54:09+00', 'Nela vê, como tinha por costume,
');
	VALUES (512, 491, TIMESTAMP WITH TIME ZONE '2020-09-11 19:32:05+00', 'O Reino Lusitano conhecido,
');

	VALUES (513, 591, TIMESTAMP WITH TIME ZONE '2020-03-31 01:15:55+00', 'Mesas d''altos manjares excelentes
');

	VALUES (514, 492, TIMESTAMP WITH TIME ZONE '2018-07-20 21:07:21+00', '(Pois que do mundo as coisas são tamanhas)
');
	VALUES (514, 492, TIMESTAMP WITH TIME ZONE '2018-07-21 04:08:41+00', 'O mundo com os varões, que esforço e arte
');
	VALUES (514, 492, TIMESTAMP WITH TIME ZONE '2018-07-21 11:10:51+00', 'E galinhas domésticas cevadas,
');

	VALUES (515, 492, TIMESTAMP WITH TIME ZONE '2019-05-11 21:32:57+00', '"A nobre ilha também de Taprobana,
');
	VALUES (515, 676, TIMESTAMP WITH TIME ZONE '2019-05-12 02:54:41+00', '"Aqui, só verdadeiros, gloriosos
');
	VALUES (515, 492, TIMESTAMP WITH TIME ZONE '2019-05-12 02:57:44+00', 'Acharam, que o caminho lhe mostraram
');
	VALUES (515, 676, TIMESTAMP WITH TIME ZONE '2019-05-12 07:48:53+00', 'Torres, montes e casas derribando.
');

	VALUES (516, 494, TIMESTAMP WITH TIME ZONE '2021-03-16 09:42:14+00', 'Dos de Lara, com os Mouros é deitado,
');
	VALUES (516, 545, TIMESTAMP WITH TIME ZONE '2021-03-16 17:14:12+00', 'Senão que aqueles, que eu cantando andava
');
	VALUES (516, 494, TIMESTAMP WITH TIME ZONE '2021-03-16 20:04:56+00', 'Para detrás a forte nau forçando;
');

	VALUES (517, 571, TIMESTAMP WITH TIME ZONE '2020-09-30 17:59:40+00', 'Estão não só do Itálico Falerno
');

	VALUES (518, 496, TIMESTAMP WITH TIME ZONE '2019-03-15 18:51:54+00', 'Que a fraca humanidade e Amor desculpa.
');
	VALUES (518, 551, TIMESTAMP WITH TIME ZONE '2019-03-15 23:52:47+00', 'Por que a boa vontade, que mostrava,
');
	VALUES (518, 551, TIMESTAMP WITH TIME ZONE '2019-03-16 05:52:37+00', 'Dois cercos contra toda a Barbaria?
');

	VALUES (519, 497, TIMESTAMP WITH TIME ZONE '2019-03-11 13:21:11+00', 'De quem me descobriu, suma vingança.
');
	VALUES (519, 497, TIMESTAMP WITH TIME ZONE '2019-03-11 20:21:54+00', 'Contra o touro remete, que fiado
');

	VALUES (520, 498, TIMESTAMP WITH TIME ZONE '2019-12-23 12:39:22+00', 'Mas alembrou-lhe üa ira que o condena,
');
	VALUES (520, 498, TIMESTAMP WITH TIME ZONE '2019-12-23 13:47:45+00', 'Que a vista cega e a mente vil também,
');
	VALUES (520, 627, TIMESTAMP WITH TIME ZONE '2019-12-23 20:21:30+00', 'Bramando duro corre, e os olhos cerra,
');
	VALUES (520, 627, TIMESTAMP WITH TIME ZONE '2019-12-23 21:52:02+00', 'Foge da gente e bela forma humana;
');

	VALUES (521, 502, TIMESTAMP WITH TIME ZONE '2021-05-08 14:24:29+00', 'Troncos nobres de seus antecessores;
');
	VALUES (521, 502, TIMESTAMP WITH TIME ZONE '2021-05-08 15:15:22+00', '"Estão de Agar os netos quase rindo
');
	VALUES (521, 502, TIMESTAMP WITH TIME ZONE '2021-05-08 16:33:29+00', 'E nos seus axes correm cintilantes.
');

	VALUES (522, 621, TIMESTAMP WITH TIME ZONE '2021-03-30 09:15:18+00', 'O Gama, que o Gentio consentisse
');
	VALUES (522, 621, TIMESTAMP WITH TIME ZONE '2021-03-30 12:54:27+00', 'Só de pedras e esforço apercebido,
');
	VALUES (522, 502, TIMESTAMP WITH TIME ZONE '2021-03-30 14:01:27+00', '"Da terra dos Algarves, que lhe fora
');

	VALUES (523, 504, TIMESTAMP WITH TIME ZONE '2021-05-04 21:20:10+00', 'O pomo que da pátria Pérsia veio,
');
	VALUES (523, 677, TIMESTAMP WITH TIME ZONE '2021-05-04 21:55:56+00', '"Assim passando aquelas regiões
');

	VALUES (524, 574, TIMESTAMP WITH TIME ZONE '2020-10-16 03:34:56+00', 'Por fogo, ferro, água, calma e frio,
');

	VALUES (525, 505, TIMESTAMP WITH TIME ZONE '2019-09-09 04:30:15+00', 'Com todas juntamente se partia,
');

	VALUES (526, 505, TIMESTAMP WITH TIME ZONE '2019-09-11 16:05:21+00', 'Os livros, que tu pedes não trazia,
');
	VALUES (526, 588, TIMESTAMP WITH TIME ZONE '2019-09-11 23:59:52+00', 'Não é ele por armas esforçado,
');
	VALUES (526, 505, TIMESTAMP WITH TIME ZONE '2019-09-12 07:58:40+00', 'Os lassos animais, na noite mansa.
');

	VALUES (527, 642, TIMESTAMP WITH TIME ZONE '2018-08-24 13:47:32+00', 'Pelo escuro Hemisfério sonolento;
');
