	VALUES (594, 573, TIMESTAMP WITH TIME ZONE '2021-01-28 18:45:41+00', 'A tranqueira soberba vê tomada.
');
	VALUES (594, 573, TIMESTAMP WITH TIME ZONE '2021-01-28 21:24:19+00', 'Jugo perpétuo, eterno cativeiro,
');
	VALUES (594, 573, TIMESTAMP WITH TIME ZONE '2021-01-28 22:03:26+00', 'Das terras que Fernando e que Rodrigo
');

	VALUES (595, 579, TIMESTAMP WITH TIME ZONE '2020-07-06 23:02:43+00', 'Do segundo himeneu não se despreza.
');
	VALUES (595, 575, TIMESTAMP WITH TIME ZONE '2020-07-07 00:53:05+00', '"Destarte a gente força e esforça Nuno,
');
	VALUES (595, 575, TIMESTAMP WITH TIME ZONE '2020-07-07 01:06:47+00', 'Eram Cristãos com Mouros juntamente.
');
	VALUES (595, 579, TIMESTAMP WITH TIME ZONE '2020-07-07 07:43:38+00', 'Para a guerra o belígero aparelho,
');

	VALUES (596, 575, TIMESTAMP WITH TIME ZONE '2020-07-01 22:34:56+00', 'Os geolhos no chão, as mãos ao céu,
');

	VALUES (597, 577, TIMESTAMP WITH TIME ZONE '2020-12-17 23:03:21+00', '"Mas depois que de todo se fartou,
');

	VALUES (598, 688, TIMESTAMP WITH TIME ZONE '2019-04-02 06:52:00+00', 'Quedas coas duras armas, tudo atroam;
');

	VALUES (599, 608, TIMESTAMP WITH TIME ZONE '2019-08-29 09:47:38+00', 'E não menos a terra; e assim festeja
');
	VALUES (599, 578, TIMESTAMP WITH TIME ZONE '2019-08-29 11:45:39+00', 'Por este largo mar enfim me alongo
');

	VALUES (600, 602, TIMESTAMP WITH TIME ZONE '2020-03-05 19:13:11+00', '"Assim diz, e abraçados os amigos,
');

	VALUES (601, 592, TIMESTAMP WITH TIME ZONE '2018-07-18 05:12:43+00', 'Como vereis o mar fervendo aceso
');

	VALUES (602, 632, TIMESTAMP WITH TIME ZONE '2020-01-31 14:52:26+00', 'Que o povo forte tem de si inimigo:
');
	VALUES (602, 579, TIMESTAMP WITH TIME ZONE '2020-01-31 15:53:46+00', 'Vos vão servir, com passo diligente,
');
	VALUES (602, 579, TIMESTAMP WITH TIME ZONE '2020-01-31 17:02:08+00', '"Eis aqui as novas partes do Oriente
');
	VALUES (602, 579, TIMESTAMP WITH TIME ZONE '2020-01-31 18:20:54+00', 'A vontade senti de tal maneira
');

	VALUES (603, 661, TIMESTAMP WITH TIME ZONE '2020-09-12 06:30:22+00', 'Do morto Conde ao mundo descobriu,
');
	VALUES (603, 580, TIMESTAMP WITH TIME ZONE '2020-09-12 11:17:48+00', 'Em quem o esforço antigo se converte
');
	VALUES (603, 580, TIMESTAMP WITH TIME ZONE '2020-09-12 17:41:33+00', 'Com a gente, e com as novas muito mais:
');
	VALUES (603, 580, TIMESTAMP WITH TIME ZONE '2020-09-12 22:43:21+00', 'Por quem a gente mais trabalha e sua,
');

	VALUES (604, 581, TIMESTAMP WITH TIME ZONE '2020-03-14 14:57:58+00', '--"Converte-se-me a carne em terra dura,
');
	VALUES (604, 662, TIMESTAMP WITH TIME ZONE '2020-03-14 22:22:11+00', 'De quem ninguém se exime dos humanos,
');

	VALUES (605, 674, TIMESTAMP WITH TIME ZONE '2018-07-13 04:40:02+00', 'Os cabelos da barba, e os que descem
');
	VALUES (605, 674, TIMESTAMP WITH TIME ZONE '2018-07-13 05:37:54+00', 'Os que habitam o Arcturo congelado,
');
	VALUES (605, 581, TIMESTAMP WITH TIME ZONE '2018-07-13 07:45:25+00', 'A terra Oriental que o Indo rega;
');

	VALUES (606, 585, TIMESTAMP WITH TIME ZONE '2020-10-31 13:43:32+00', 'Saudosos na vista e descontentes.
');
	VALUES (606, 582, TIMESTAMP WITH TIME ZONE '2020-10-31 15:21:07+00', 'Que das serras de Conca vem manando.
');
	VALUES (606, 582, TIMESTAMP WITH TIME ZONE '2020-10-31 22:39:25+00', 'Mas como nunca enfim meus companheiros
');

	VALUES (607, 627, TIMESTAMP WITH TIME ZONE '2020-10-02 18:05:13+00', 'Ocultos os juízos de Deus são;
');
	VALUES (607, 582, TIMESTAMP WITH TIME ZONE '2020-10-02 20:28:19+00', '"Já lhe foi (bem o vistes) concedido
');
	VALUES (607, 627, TIMESTAMP WITH TIME ZONE '2020-10-03 02:19:24+00', 'Junto da costa brava levantaram,
');

	VALUES (608, 583, TIMESTAMP WITH TIME ZONE '2020-01-23 03:30:27+00', '"A gente da cidade aquele dia,
');
	VALUES (608, 583, TIMESTAMP WITH TIME ZONE '2020-01-23 07:05:41+00', 'Que não é prémio vil ser conhecido
');
	VALUES (608, 583, TIMESTAMP WITH TIME ZONE '2020-01-23 10:51:48+00', '"Qual o touro cioso, que se ensaia
');
	VALUES (608, 661, TIMESTAMP WITH TIME ZONE '2020-01-23 11:49:00+00', '"Não creias, fero Bóreas, que te creio
');

	VALUES (609, 621, TIMESTAMP WITH TIME ZONE '2020-11-12 18:55:21+00', 'Que para o Rei Judaico acrescentar-se.
');
	VALUES (609, 621, TIMESTAMP WITH TIME ZONE '2020-11-12 23:02:18+00', 'Português terá sempre levantado,
');

	VALUES (610, 586, TIMESTAMP WITH TIME ZONE '2019-03-10 08:40:29+00', 'Com frutas, aves, carnes e pescados.
');

	VALUES (611, 601, TIMESTAMP WITH TIME ZONE '2021-02-16 04:40:19+00', 'Todos foram de fraca carne humana.
');

	VALUES (612, 649, TIMESTAMP WITH TIME ZONE '2020-12-20 08:51:49+00', 'E tomada licença, enfim se parte:
');
	VALUES (612, 588, TIMESTAMP WITH TIME ZONE '2020-12-20 13:27:02+00', 'Pelas guerras famosas e excelentes
');
	VALUES (612, 649, TIMESTAMP WITH TIME ZONE '2020-12-20 14:12:38+00', 'Se alegra, e veste ali do animal de Hele,
');

	VALUES (613, 596, TIMESTAMP WITH TIME ZONE '2021-02-06 04:37:46+00', '"Olha este desleal o como paga
');
	VALUES (613, 589, TIMESTAMP WITH TIME ZONE '2021-02-06 09:23:50+00', 'Ficou-lhe o filho pouco obediente,
');
	VALUES (613, 596, TIMESTAMP WITH TIME ZONE '2021-02-06 14:23:58+00', 'Atada levas? Ou, depois de presa,
');
	VALUES (613, 589, TIMESTAMP WITH TIME ZONE '2021-02-06 15:54:13+00', 'Ajuntando outros muitos, que pretende
');

	VALUES (614, 593, TIMESTAMP WITH TIME ZONE '2019-05-01 23:41:32+00', 'Em desafios, justas e torneios,
');
	VALUES (614, 593, TIMESTAMP WITH TIME ZONE '2019-05-02 04:05:10+00', '"Todas de correr cansam, Ninfa pura,
');
	VALUES (614, 589, TIMESTAMP WITH TIME ZONE '2019-05-02 07:16:41+00', '"Não menos têm mostrado esforço e manha
');
	VALUES (614, 593, TIMESTAMP WITH TIME ZONE '2019-05-02 13:06:14+00', 'E tinha já por firme pressuposto
');

	VALUES (615, 666, TIMESTAMP WITH TIME ZONE '2020-12-18 13:48:44+00', 'De Gerum, de Mazcate e Calaiate;
');

	VALUES (616, 592, TIMESTAMP WITH TIME ZONE '2021-05-14 14:38:25+00', 'Não se contenta a gente Portuguesa,
');
	VALUES (616, 653, TIMESTAMP WITH TIME ZONE '2021-05-14 17:38:28+00', 'Sinais de tua incógnita verdade?
');
	VALUES (616, 592, TIMESTAMP WITH TIME ZONE '2021-05-14 22:40:37+00', 'Alegres vinham todos, porque crêm
');
	VALUES (616, 592, TIMESTAMP WITH TIME ZONE '2021-05-15 04:11:04+00', 'Os assopros esforça iradamente,
');

	VALUES (617, 636, TIMESTAMP WITH TIME ZONE '2021-01-07 14:08:11+00', 'D''além do claro Tejo deleitoso;
');
	VALUES (617, 636, TIMESTAMP WITH TIME ZONE '2021-01-07 19:28:00+00', 'Que, pelo mar que já deixais sabido,
');
	VALUES (617, 594, TIMESTAMP WITH TIME ZONE '2021-01-07 21:40:44+00', 'Fogo de altos desejos, que a movera!
');
	VALUES (617, 636, TIMESTAMP WITH TIME ZONE '2021-01-08 02:59:14+00', 'De quem ficam memórias soberanas,
');

	VALUES (618, 674, TIMESTAMP WITH TIME ZONE '2018-08-15 17:09:53+00', 'Alguns, que em espingardas e nas bestas,
');
	VALUES (618, 595, TIMESTAMP WITH TIME ZONE '2018-08-15 17:56:17+00', 'Sem vento suas águas encrespando.
');
	VALUES (618, 595, TIMESTAMP WITH TIME ZONE '2018-08-15 22:56:50+00', 'Tal embaixada dava o Capitão,
');
	VALUES (618, 674, TIMESTAMP WITH TIME ZONE '2018-08-16 04:36:55+00', '"Já do seu Rei tomado têm licença
');

	VALUES (619, 595, TIMESTAMP WITH TIME ZONE '2018-08-29 06:36:59+00', 'Mil árvores estão ao céu subindo,
');
	VALUES (619, 595, TIMESTAMP WITH TIME ZONE '2018-08-29 14:08:31+00', 'Qual o das moças Bíbli e Cinireia,
');

	VALUES (620, 663, TIMESTAMP WITH TIME ZONE '2021-01-11 19:08:50+00', 'Pela praia brincando vem diante
');
	VALUES (620, 596, TIMESTAMP WITH TIME ZONE '2021-01-11 20:06:01+00', 'Dos filhos e das filhas que gerara;
');
	VALUES (620, 663, TIMESTAMP WITH TIME ZONE '2021-01-11 20:24:45+00', 'Para onde a Natureza tinha posta
');

	VALUES (621, 629, TIMESTAMP WITH TIME ZONE '2021-01-23 01:31:02+00', 'Júpiter, Juno, fomos fabulosos,
');
	VALUES (621, 629, TIMESTAMP WITH TIME ZONE '2021-01-23 08:28:27+00', 'Que o coração pressago nunca mente.
');
	VALUES (621, 629, TIMESTAMP WITH TIME ZONE '2021-01-23 13:20:27+00', 'Abrandar determina, por amores,
');
	VALUES (621, 629, TIMESTAMP WITH TIME ZONE '2021-01-23 20:01:54+00', 'Que o vil ócio no mundo traz consigo,
');

	VALUES (622, 638, TIMESTAMP WITH TIME ZONE '2019-10-15 10:20:20+00', 'Que segredos são estes de Natura.
');
	VALUES (622, 638, TIMESTAMP WITH TIME ZONE '2019-10-15 17:34:03+00', 'Dizia, eis aqui venho oferecido
');
	VALUES (622, 597, TIMESTAMP WITH TIME ZONE '2019-10-16 00:04:38+00', 'Em grosso a consciência limpa e certa,
');

	VALUES (623, 665, TIMESTAMP WITH TIME ZONE '2020-09-02 01:38:46+00', 'Vai César, sojugando toda França,
');
	VALUES (623, 598, TIMESTAMP WITH TIME ZONE '2020-09-02 05:59:52+00', '"Este povo que é meu, por quem derramo
');
	VALUES (623, 598, TIMESTAMP WITH TIME ZONE '2020-09-02 11:46:41+00', 'Falar ao Rei gentio determina,
');

	VALUES (624, 647, TIMESTAMP WITH TIME ZONE '2020-09-21 10:46:04+00', 'A terra nunca de outrem sojugada.
');
	VALUES (624, 647, TIMESTAMP WITH TIME ZONE '2020-09-21 12:51:57+00', 'Cai a soberba Inglesa de seu trono,
');
	VALUES (624, 598, TIMESTAMP WITH TIME ZONE '2020-09-21 17:34:44+00', 'Os Cicones, e a torra onde se esqueçam
');
	VALUES (624, 598, TIMESTAMP WITH TIME ZONE '2020-09-21 21:24:41+00', 'Dos nascidos direi na nossa terra,
');

	VALUES (625, 599, TIMESTAMP WITH TIME ZONE '2020-07-17 22:28:15+00', 'Dentro no salso rio entrar queria.
');

	VALUES (626, 601, TIMESTAMP WITH TIME ZONE '2020-04-22 18:30:31+00', 'Cortam do mar do Norte as ondas frias.
');
	VALUES (626, 650, TIMESTAMP WITH TIME ZONE '2020-04-22 21:53:56+00', 'Que os Melindanos têm tão rudo peito,
');

	VALUES (627, 602, TIMESTAMP WITH TIME ZONE '2020-12-15 03:33:13+00', 'Escura faz qualquer estranha glória;
');
	VALUES (627, 602, TIMESTAMP WITH TIME ZONE '2020-12-15 10:47:15+00', 'Tanto Deus se contenta de humildade!
');
	VALUES (627, 649, TIMESTAMP WITH TIME ZONE '2020-12-15 12:00:00+00', 'Alguns tredores houve algumas vezes.
');
	VALUES (627, 602, TIMESTAMP WITH TIME ZONE '2020-12-15 12:48:37+00', 'De um sumptuoso templo, já chegavam,
');

	VALUES (628, 637, TIMESTAMP WITH TIME ZONE '2020-04-19 10:48:41+00', 'A laranjeira tem no fruto lindo
');
	VALUES (628, 602, TIMESTAMP WITH TIME ZONE '2020-04-19 10:58:03+00', 'Como a Sansão Hebréio da guedelha,
');
	VALUES (628, 602, TIMESTAMP WITH TIME ZONE '2020-04-19 16:39:22+00', 'De vós tão longe, sempre obedientes;
');

	VALUES (629, 640, TIMESTAMP WITH TIME ZONE '2020-07-03 14:59:42+00', 'Outra coisa não é que as deleitosas
');
	VALUES (629, 640, TIMESTAMP WITH TIME ZONE '2020-07-03 18:16:28+00', 'Vê Catigão, cidade das milhores
');

	VALUES (630, 672, TIMESTAMP WITH TIME ZONE '2021-04-28 21:07:18+00', 'Cai qualquer, sem ver o vulto que ama:
');
	VALUES (630, 672, TIMESTAMP WITH TIME ZONE '2021-04-29 01:53:24+00', 'Ao duro cerco, que lhe estava posto.
');
	VALUES (630, 604, TIMESTAMP WITH TIME ZONE '2021-04-29 09:16:54+00', 'Do conhecido pólo de Calisto,
');

	VALUES (631, 605, TIMESTAMP WITH TIME ZONE '2020-12-25 03:37:37+00', 'Uns vão nas almadias carregadas,
');
	VALUES (631, 605, TIMESTAMP WITH TIME ZONE '2020-12-25 07:08:54+00', 'Este como limite está lançado
');
	VALUES (631, 683, TIMESTAMP WITH TIME ZONE '2020-12-25 11:20:41+00', 'E entre gente remota edificaram
');
	VALUES (631, 683, TIMESTAMP WITH TIME ZONE '2020-12-25 13:04:07+00', '"E vendo o Rei sublime Castelhano
');

	VALUES (632, 655, TIMESTAMP WITH TIME ZONE '2019-08-03 21:52:04+00', 'Mas mandas-me louvar dos meus a glória.
');
	VALUES (632, 655, TIMESTAMP WITH TIME ZONE '2019-08-03 23:00:06+00', 'Com usadas e ledas pescarias,
');

	VALUES (633, 606, TIMESTAMP WITH TIME ZONE '2019-10-17 08:58:53+00', 'Do enganoso ardil, que o Mouro urdia,
');
	VALUES (633, 670, TIMESTAMP WITH TIME ZONE '2019-10-17 14:01:43+00', '--"Aqui espero tomar, se não me engano,
');

	VALUES (634, 614, TIMESTAMP WITH TIME ZONE '2020-12-25 15:53:51+00', 'Onde as setas de ponta de ouro embebe.
');
	VALUES (634, 614, TIMESTAMP WITH TIME ZONE '2020-12-25 22:14:45+00', 'As outras pelas sombras entre as flores.
');

	VALUES (635, 663, TIMESTAMP WITH TIME ZONE '2020-11-25 21:32:51+00', 'Que pelejando está co''o Mauritano.
');

	VALUES (636, 608, TIMESTAMP WITH TIME ZONE '2020-10-07 04:46:05+00', 'Por ser Mouro como eles, antes era
');

	VALUES (637, 691, TIMESTAMP WITH TIME ZONE '2019-02-15 21:04:42+00', 'Quando o Gama, colos seus determinava
');
	VALUES (637, 691, TIMESTAMP WITH TIME ZONE '2019-02-15 22:56:37+00', 'Abraçados as almas soltarão
');
	VALUES (637, 609, TIMESTAMP WITH TIME ZONE '2019-02-16 02:39:10+00', 'Espantado ficou da grã viagem
');

	VALUES (638, 668, TIMESTAMP WITH TIME ZONE '2019-08-28 07:01:49+00', 'Por contraste de vento àquela parte,
');

	VALUES (639, 625, TIMESTAMP WITH TIME ZONE '2020-06-19 02:21:14+00', 'Pola ilustrar no fim de tantos anos
');

	VALUES (640, 670, TIMESTAMP WITH TIME ZONE '2019-09-01 18:35:28+00', 'Outras em derredor levando-a estavam,
');
	VALUES (640, 615, TIMESTAMP WITH TIME ZONE '2019-09-02 01:50:28+00', 'Sármatas outro tempo; e na montanha
');
	VALUES (640, 670, TIMESTAMP WITH TIME ZONE '2019-09-02 09:46:12+00', 'Rio pelos antigos nunca visto.
');

	VALUES (641, 638, TIMESTAMP WITH TIME ZONE '2019-08-25 16:13:51+00', 'Que nos ombros dos homens é levado.
');
	VALUES (641, 615, TIMESTAMP WITH TIME ZONE '2019-08-25 20:57:29+00', '"Choraram-te, Tomé, o Gange e o Indo;
');

	VALUES (642, 689, TIMESTAMP WITH TIME ZONE '2018-09-02 03:09:58+00', 'Sustentava contra ele Vénus bela,
');
	VALUES (642, 689, TIMESTAMP WITH TIME ZONE '2018-09-02 05:51:32+00', 'O hospício que o cru Diomedes dava,
');

	VALUES (643, 619, TIMESTAMP WITH TIME ZONE '2020-03-11 16:37:48+00', 'Como se desse em vão nalgum rochedo.
');
	VALUES (643, 641, TIMESTAMP WITH TIME ZONE '2020-03-11 17:59:02+00', 'Pera onde faça um sumptuoso templo
');
	VALUES (643, 641, TIMESTAMP WITH TIME ZONE '2020-03-11 19:30:12+00', 'Arrepiam-se as carnes e o cabelo
');

	VALUES (644, 620, TIMESTAMP WITH TIME ZONE '2021-02-02 05:52:55+00', 'Ou se são dos de Cristo, como Crê.
');
	VALUES (644, 620, TIMESTAMP WITH TIME ZONE '2021-02-02 06:00:38+00', 'E porque mais aqui se amanse e dome
');
	VALUES (644, 636, TIMESTAMP WITH TIME ZONE '2021-02-02 13:55:03+00', 'De quem vergonha é natural reparo,
');
	VALUES (644, 636, TIMESTAMP WITH TIME ZONE '2021-02-02 17:55:15+00', 'Ela nos paços logra seus amores,
');

	VALUES (645, 621, TIMESTAMP WITH TIME ZONE '2020-11-21 13:44:43+00', 'Já dão sinal, e o som da tuba impele
');
	VALUES (645, 666, TIMESTAMP WITH TIME ZONE '2020-11-21 20:03:04+00', 'Viúva e triste, e posta em vida escura,
');
	VALUES (645, 621, TIMESTAMP WITH TIME ZONE '2020-11-22 02:33:26+00', 'Não sem sangue, porém, que nele geme
');
	VALUES (645, 621, TIMESTAMP WITH TIME ZONE '2020-11-22 07:29:27+00', 'Qual Anúbis Menfítico se adora.
');

	VALUES (646, 623, TIMESTAMP WITH TIME ZONE '2018-05-21 13:20:24+00', 'Que obedecerá logo à voz sagrada,
');
	VALUES (646, 623, TIMESTAMP WITH TIME ZONE '2018-05-21 15:05:02+00', 'Porque também com os grandes e possantes
');
	VALUES (646, 663, TIMESTAMP WITH TIME ZONE '2018-05-21 15:08:42+00', 'Virá ali o Samorim, por que em pessoa
');

	VALUES (647, 625, TIMESTAMP WITH TIME ZONE '2019-09-17 11:23:40+00', 'E depois por Jesu certificado.
');
	VALUES (647, 693, TIMESTAMP WITH TIME ZONE '2019-09-17 15:41:28+00', 'Cada um as vergonhosas partes cinge.
');
	VALUES (647, 693, TIMESTAMP WITH TIME ZONE '2019-09-17 21:25:00+00', 'Quão doce é o louvor e a justa glória
');
	VALUES (647, 693, TIMESTAMP WITH TIME ZONE '2019-09-17 23:43:55+00', 'Aquela noite esteve ali detido,
');

	VALUES (648, 675, TIMESTAMP WITH TIME ZONE '2019-10-10 00:05:59+00', '"E foi que, estando já da costa perto,
');
	VALUES (648, 675, TIMESTAMP WITH TIME ZONE '2019-10-10 00:11:13+00', 'Com as Deusas despidas, que se lavam:
');

	VALUES (649, 626, TIMESTAMP WITH TIME ZONE '2020-04-21 21:19:19+00', 'Bem como a cada qual coubera em sorte.
');
	VALUES (649, 629, TIMESTAMP WITH TIME ZONE '2020-04-22 05:19:19+00', 'E pelo céu chovendo enfim voou,
');
	VALUES (649, 626, TIMESTAMP WITH TIME ZONE '2020-04-22 12:37:02+00', 'Tão cega fica, quanto ficareis,
');

	VALUES (650, 626, TIMESTAMP WITH TIME ZONE '2020-10-13 18:46:00+00', '"Cinco Reis Mouros são os inimigos,
');
	VALUES (650, 648, TIMESTAMP WITH TIME ZONE '2020-10-14 01:37:42+00', 'Vitupério nenhum, mas só desgosto.
');
	VALUES (650, 648, TIMESTAMP WITH TIME ZONE '2020-10-14 02:20:53+00', 'Os Pereiras também arrenegados
');
	VALUES (650, 648, TIMESTAMP WITH TIME ZONE '2020-10-14 03:06:05+00', 'Como inda agora faz a gente inica.
');

	VALUES (651, 679, TIMESTAMP WITH TIME ZONE '2020-01-30 18:52:56+00', 'Esta, meia escondida, que responde
');
	VALUES (651, 679, TIMESTAMP WITH TIME ZONE '2020-01-30 20:24:03+00', '"Mas de Deus a escondida providência
');
	VALUES (651, 627, TIMESTAMP WITH TIME ZONE '2020-01-31 04:15:05+00', 'Um mancebo de Assíria, um de Judeia.
');
	VALUES (651, 627, TIMESTAMP WITH TIME ZONE '2020-01-31 08:46:56+00', 'Onde Amor as enreda brandamente,
');

	VALUES (652, 630, TIMESTAMP WITH TIME ZONE '2020-02-10 05:43:23+00', 'As mulheres c''um choro piedoso,
');
	VALUES (652, 627, TIMESTAMP WITH TIME ZONE '2020-02-10 13:43:01+00', 'Com a superstição falsa e profana
');
	VALUES (652, 630, TIMESTAMP WITH TIME ZONE '2020-02-10 16:24:09+00', 'Da mágoa, da desonra, e triste nojo
');
	VALUES (652, 627, TIMESTAMP WITH TIME ZONE '2020-02-10 22:54:03+00', 'Fazei que torne lá às silvestres covas
');

	VALUES (653, 628, TIMESTAMP WITH TIME ZONE '2019-06-04 05:04:33+00', 'Que a gente bruta mais que virtude ama.
');

	VALUES (654, 649, TIMESTAMP WITH TIME ZONE '2021-01-23 21:49:02+00', 'O mar nas praias notas que ali temos,
');
	VALUES (654, 649, TIMESTAMP WITH TIME ZONE '2021-01-23 22:46:26+00', 'Do que ao grande Dario tanto pesa,
');
	VALUES (654, 649, TIMESTAMP WITH TIME ZONE '2021-01-23 23:58:42+00', '--"Quem será estoutro cá, que o campo arrasa
');
	VALUES (654, 628, TIMESTAMP WITH TIME ZONE '2021-01-24 05:56:04+00', 'Não tornes por detrás, pois é fraqueza
');

	VALUES (655, 629, TIMESTAMP WITH TIME ZONE '2020-04-07 01:17:30+00', 'Da Juliana, má, e desleal manha.
');
	VALUES (655, 629, TIMESTAMP WITH TIME ZONE '2020-04-07 03:47:57+00', 'Não me mandas contar estranha história,
');
	VALUES (655, 690, TIMESTAMP WITH TIME ZONE '2020-04-07 11:47:45+00', 'E vendo claro quanto lhe releva
');
	VALUES (655, 690, TIMESTAMP WITH TIME ZONE '2020-04-07 17:41:12+00', 'Vê Méroe, que ilha foi de antiga fama,
');

	VALUES (656, 660, TIMESTAMP WITH TIME ZONE '2018-10-05 11:14:02+00', 'Mostrando-se no mar um fero raio,
');
	VALUES (656, 630, TIMESTAMP WITH TIME ZONE '2018-10-05 17:00:37+00', 'Mas sempre (o Céu querendo) fará menos.
');
	VALUES (656, 630, TIMESTAMP WITH TIME ZONE '2018-10-05 22:33:33+00', 'Desejou nunca; e bem se manifesta
');

	VALUES (657, 637, TIMESTAMP WITH TIME ZONE '2021-01-01 05:15:22+00', 'Deixou, quem o levou quem governasse,
');
	VALUES (657, 633, TIMESTAMP WITH TIME ZONE '2021-01-01 06:24:31+00', 'Senão da Portuguesa tão somente.
');

	VALUES (658, 680, TIMESTAMP WITH TIME ZONE '2020-11-16 19:46:22+00', 'De grandes naus, pelo Índico Oceano,
');
	VALUES (658, 680, TIMESTAMP WITH TIME ZONE '2020-11-17 02:55:53+00', 'Aqui de outras cidades, sem debate,
');

	VALUES (659, 677, TIMESTAMP WITH TIME ZONE '2021-05-04 21:26:45+00', 'No mundo cometeram grandes cousas,
');

	VALUES (660, 695, TIMESTAMP WITH TIME ZONE '2021-01-23 15:37:15+00', 'Nas rapinas aéreas têm o intento,
');
	VALUES (660, 695, TIMESTAMP WITH TIME ZONE '2021-01-23 21:28:51+00', 'A ver os berços onde nasce o dia.
');

	VALUES (661, 685, TIMESTAMP WITH TIME ZONE '2021-02-27 09:27:20+00', 'Gentes que tais caminhos cometessem?
');

	VALUES (662, 636, TIMESTAMP WITH TIME ZONE '2021-05-02 06:05:22+00', 'Mas os Anjos do Céu, cantando e rindo,
');

	VALUES (663, 665, TIMESTAMP WITH TIME ZONE '2021-01-13 14:10:46+00', 'Da transparente massa cristalina:
');
	VALUES (663, 665, TIMESTAMP WITH TIME ZONE '2021-01-13 21:31:49+00', 'De Portugal, armar madeiro leve
');

	VALUES (664, 690, TIMESTAMP WITH TIME ZONE '2019-03-19 09:20:00+00', 'Assi foi do Saber, alto e profundo,
');
	VALUES (664, 690, TIMESTAMP WITH TIME ZONE '2019-03-19 13:57:41+00', 'Por juízos incógnitos de Deus.
');
	VALUES (664, 690, TIMESTAMP WITH TIME ZONE '2019-03-19 15:39:10+00', 'Que tanto em seus descuidos se desmede,
');
	VALUES (664, 690, TIMESTAMP WITH TIME ZONE '2019-03-19 18:12:05+00', 'Mas de caminho pouca quantidade.
');

	VALUES (665, 642, TIMESTAMP WITH TIME ZONE '2018-11-03 10:22:11+00', 'E mar tranquilo, pera a pátria amada."
');

	VALUES (666, 686, TIMESTAMP WITH TIME ZONE '2019-12-04 08:14:40+00', 'Vos vêm tomar a vossa antiga terra,
');
	VALUES (666, 638, TIMESTAMP WITH TIME ZONE '2019-12-04 10:52:30+00', 'Pelos paternais paços sublimados,
');

	VALUES (667, 661, TIMESTAMP WITH TIME ZONE '2019-12-13 14:47:41+00', 'Levando alegres novas e resposta
');
	VALUES (667, 638, TIMESTAMP WITH TIME ZONE '2019-12-13 16:57:51+00', 'De soldados não fora Lusitano,
');
	VALUES (667, 638, TIMESTAMP WITH TIME ZONE '2019-12-13 22:23:31+00', '''Aurea'', por epitéto lhe ajuntaram;
');

	VALUES (668, 693, TIMESTAMP WITH TIME ZONE '2019-09-17 23:45:52+00', 'Os Reis da índia, livres e seguros,
');
	VALUES (668, 693, TIMESTAMP WITH TIME ZONE '2019-09-18 07:13:16+00', 'Que, ou tu não sofrerás o peso dela,
');

	VALUES (669, 685, TIMESTAMP WITH TIME ZONE '2021-04-05 14:40:57+00', 'A navegação certa, e assim caminha
');

	VALUES (670, 648, TIMESTAMP WITH TIME ZONE '2020-09-21 17:15:23+00', 'Mas desta sorte o Gama respondia:
');
	VALUES (670, 648, TIMESTAMP WITH TIME ZONE '2020-09-21 21:41:02+00', '"Se com grandes presentes de alta estima
');
	VALUES (670, 648, TIMESTAMP WITH TIME ZONE '2020-09-22 05:03:25+00', 'Que já naquele tempo as mais Guerreiras
');
	VALUES (670, 640, TIMESTAMP WITH TIME ZONE '2020-09-22 05:33:53+00', 'Que se escureça o teu querido Orfeio.
');

	VALUES (671, 695, TIMESTAMP WITH TIME ZONE '2019-10-01 16:52:58+00', 'Sois os dentes de Cadmo desparzidos,
');
	VALUES (671, 695, TIMESTAMP WITH TIME ZONE '2019-10-01 20:34:05+00', 'Faria tremular e pôr espanto
');
	VALUES (671, 695, TIMESTAMP WITH TIME ZONE '2019-10-02 02:23:49+00', 'Ainda confiados, se ajuntavam
');

	VALUES (672, 686, TIMESTAMP WITH TIME ZONE '2019-11-21 11:41:05+00', 'E com razões notáveis e discretas
');

	VALUES (673, 649, TIMESTAMP WITH TIME ZONE '2021-01-05 15:23:33+00', 'A rédea larga às aves, cujo canto
');
	VALUES (673, 649, TIMESTAMP WITH TIME ZONE '2021-01-05 17:03:03+00', 'Estendem não sòmente a Lei de cima,
');

	VALUES (674, 643, TIMESTAMP WITH TIME ZONE '2018-07-09 21:05:43+00', 'E logo lhe nomeia doze fortes;
');
	VALUES (674, 691, TIMESTAMP WITH TIME ZONE '2018-07-09 21:41:38+00', 'Dois modos há de gente, porque a nobre
');

	VALUES (675, 644, TIMESTAMP WITH TIME ZONE '2020-01-13 22:36:53+00', 'Melinde, onde achará piloto certo.
');
	VALUES (675, 644, TIMESTAMP WITH TIME ZONE '2020-01-14 00:35:40+00', 'Mas queimar-lhe-á lugares, templos, casas;
');
	VALUES (675, 696, TIMESTAMP WITH TIME ZONE '2020-01-14 05:17:51+00', 'Que o nome tem da terra, para exemplo,
');
	VALUES (675, 696, TIMESTAMP WITH TIME ZONE '2020-01-14 09:22:51+00', 'No ar lascivos beijos se vão dando.
');

	VALUES (676, 686, TIMESTAMP WITH TIME ZONE '2019-12-10 18:37:08+00', 'Corre Narsinga, rica e poderosa;
');

	VALUES (677, 668, TIMESTAMP WITH TIME ZONE '2019-07-16 02:04:03+00', 'Austral, parte do mundo mais secreta.
');

	VALUES (678, 646, TIMESTAMP WITH TIME ZONE '2019-08-06 11:38:23+00', 'Bem como o antigo Jano se pintava;
');
	VALUES (678, 666, TIMESTAMP WITH TIME ZONE '2019-08-06 17:14:19+00', 'Cantando em baxa voz, envolta em choro,
');
	VALUES (678, 666, TIMESTAMP WITH TIME ZONE '2019-08-06 21:08:45+00', 'Ali são seus trabalhos e fadigas,
');

	VALUES (679, 647, TIMESTAMP WITH TIME ZONE '2020-08-31 14:39:47+00', 'Do rico aljôfar que nas conchas nasce,
');

	VALUES (680, 647, TIMESTAMP WITH TIME ZONE '2020-09-06 04:24:42+00', 'Em ti o remédio certo que queremos.
');
	VALUES (680, 647, TIMESTAMP WITH TIME ZONE '2020-09-06 07:45:22+00', 'Aqui gentes estranhas lava e rega
');

	VALUES (681, 648, TIMESTAMP WITH TIME ZONE '2020-09-09 22:37:24+00', 'A frota coas bombardas o festeja,
');
	VALUES (681, 679, TIMESTAMP WITH TIME ZONE '2020-09-10 04:32:20+00', 'Destruição de gente, e de valia.
');
	VALUES (681, 648, TIMESTAMP WITH TIME ZONE '2020-09-10 10:22:46+00', 'E Judeia, que um Deus adora e ama,
');

	VALUES (682, 650, TIMESTAMP WITH TIME ZONE '2021-03-29 22:32:52+00', 'Fará espalhar a fraca e grande armada
');
	VALUES (682, 650, TIMESTAMP WITH TIME ZONE '2021-03-29 23:15:08+00', 'Nos muros de Bizâncio e de Turquia.
');

	VALUES (683, 661, TIMESTAMP WITH TIME ZONE '2020-02-04 19:46:15+00', 'Todos favorecei em seus ofícios,
');
	VALUES (683, 661, TIMESTAMP WITH TIME ZONE '2020-02-04 21:12:18+00', 'Não no vês tinto de ira, que reprende
');
	VALUES (683, 650, TIMESTAMP WITH TIME ZONE '2020-02-05 04:13:41+00', 'Nem nega que esse nome preminente
');
	VALUES (683, 650, TIMESTAMP WITH TIME ZONE '2020-02-05 07:09:59+00', 'As forças exercitam, de inimigas
');

	VALUES (684, 652, TIMESTAMP WITH TIME ZONE '2020-02-10 19:02:14+00', 'Que mais move a piedade que a vingança.
');
	VALUES (684, 652, TIMESTAMP WITH TIME ZONE '2020-02-10 21:42:53+00', 'Aqueles que as cidades fazem rasas,
');
	VALUES (684, 667, TIMESTAMP WITH TIME ZONE '2020-02-11 00:49:55+00', 'Porque não quis o moço sujeitar-se,
');

	VALUES (685, 685, TIMESTAMP WITH TIME ZONE '2021-05-13 10:49:45+00', '--"Aqui espero tomar, se não me engano,
');
	VALUES (685, 653, TIMESTAMP WITH TIME ZONE '2021-05-13 16:13:27+00', 'Grandemente, por certo, estão provados,
');

	VALUES (686, 681, TIMESTAMP WITH TIME ZONE '2021-03-30 15:25:45+00', 'A fortíssima torre de Babel.
');
	VALUES (686, 653, TIMESTAMP WITH TIME ZONE '2021-03-30 19:13:49+00', 'Outros subis telhados e paredes:
');

	VALUES (687, 654, TIMESTAMP WITH TIME ZONE '2020-06-07 07:10:06+00', 'E aquele que a seu Reino a segurança
');

	VALUES (688, 682, TIMESTAMP WITH TIME ZONE '2020-05-29 15:04:59+00', 'Que aparta a Barbaria de Etiópia.
');
	VALUES (688, 682, TIMESTAMP WITH TIME ZONE '2020-05-29 21:31:02+00', 'Começa de julgar por enganados
');
	VALUES (688, 654, TIMESTAMP WITH TIME ZONE '2020-05-30 02:07:18+00', '"Olha estoutra bandeira, e vê pintado
');
	VALUES (688, 682, TIMESTAMP WITH TIME ZONE '2020-05-30 04:13:55+00', 'O fio de seus dias já maduros,
');

	VALUES (689, 655, TIMESTAMP WITH TIME ZONE '2020-01-03 06:01:13+00', 'Entramos, navegando, pelas filhas
');

	VALUES (690, 658, TIMESTAMP WITH TIME ZONE '2020-12-26 03:26:48+00', 'Viriato sabemos que se chama,
');
	VALUES (690, 657, TIMESTAMP WITH TIME ZONE '2020-12-26 09:03:02+00', 'Outras muitas a tem por companheira:
');
	VALUES (690, 657, TIMESTAMP WITH TIME ZONE '2020-12-26 09:15:48+00', 'Pela mão, já conformes e contentes,
');

	VALUES (691, 657, TIMESTAMP WITH TIME ZONE '2020-08-09 11:42:10+00', 'Estava o Sol nas armas rutilando
');
	VALUES (691, 657, TIMESTAMP WITH TIME ZONE '2020-08-09 18:52:19+00', 'E para dizer tudo, temo e creio,
');
	VALUES (691, 657, TIMESTAMP WITH TIME ZONE '2020-08-10 00:52:10+00', 'Vencestes esta gente tão guerreira?
');
	VALUES (691, 657, TIMESTAMP WITH TIME ZONE '2020-08-10 05:33:30+00', 'Nem os Décios leais fizeram tanto.
');

	VALUES (692, 658, TIMESTAMP WITH TIME ZONE '2021-01-10 03:50:22+00', 'Que vem já dar a dura e eterna pena,
');

	VALUES (693, 659, TIMESTAMP WITH TIME ZONE '2021-01-25 19:02:54+00', 'Galegos e Leoneses cavaleiros,
');

	VALUES (694, 684, TIMESTAMP WITH TIME ZONE '2020-10-26 01:36:18+00', 'Uma gente fortíssima de Espanha
');

	VALUES (695, 659, TIMESTAMP WITH TIME ZONE '2020-12-01 19:18:43+00', 'Que os peitos generosos enobrece,
');
	VALUES (695, 659, TIMESTAMP WITH TIME ZONE '2020-12-01 21:48:57+00', 'Os olhos lhe ocupou o sono aceito,
');

	VALUES (696, 691, TIMESTAMP WITH TIME ZONE '2018-10-26 02:47:09+00', 'Por juízos incógnitos de Deus.
');

	VALUES (697, 671, TIMESTAMP WITH TIME ZONE '2020-01-28 05:58:51+00', 'Com sonoroso aplauso, vozes davam,
');
	VALUES (697, 671, TIMESTAMP WITH TIME ZONE '2020-01-28 08:12:35+00', 'Toda a corte alvoroça a novidade;
');
	VALUES (697, 671, TIMESTAMP WITH TIME ZONE '2020-01-28 08:59:24+00', 'Faria tremular e pôr espanto
');

	VALUES (698, 661, TIMESTAMP WITH TIME ZONE '2019-12-22 15:26:30+00', 'Que Amor por grã mercê lhe terá dado.
');

	VALUES (699, 663, TIMESTAMP WITH TIME ZONE '2019-10-20 21:31:19+00', 'Estelífero pólo, e claro assento,
');
	VALUES (699, 693, TIMESTAMP WITH TIME ZONE '2019-10-21 01:43:42+00', 'Coração, vos fizestes inimigos,
');

	VALUES (700, 691, TIMESTAMP WITH TIME ZONE '2018-05-02 21:51:05+00', 'Quem sois, que terra é esta que habitais,
');
	VALUES (700, 691, TIMESTAMP WITH TIME ZONE '2018-05-03 04:49:49+00', 'Vêem-se os quatro elementos trasladados
');

	VALUES (701, 672, TIMESTAMP WITH TIME ZONE '2018-10-25 21:02:16+00', 'Que faz que o chão debaixo todo treme;
');
	VALUES (701, 672, TIMESTAMP WITH TIME ZONE '2018-10-26 04:03:01+00', 'Ou das gentes belígeras de Espanha,
');
	VALUES (701, 672, TIMESTAMP WITH TIME ZONE '2018-10-26 07:06:02+00', 'Pouco e pouco sorrindo e gritos dando,
');

	VALUES (702, 690, TIMESTAMP WITH TIME ZONE '2019-03-16 21:16:44+00', 'Abrolhos férreos mil, passos estreitos,
');
	VALUES (702, 664, TIMESTAMP WITH TIME ZONE '2019-03-17 00:28:09+00', 'Que nesse tenro gesto vos contemplo,
');
	VALUES (702, 690, TIMESTAMP WITH TIME ZONE '2019-03-17 03:02:42+00', 'Subida pela enxárcia, de admirada,
');

	VALUES (703, 673, TIMESTAMP WITH TIME ZONE '2021-05-21 12:45:39+00', 'Amam somente mandos e riqueza,
');

	VALUES (704, 666, TIMESTAMP WITH TIME ZONE '2019-09-05 12:01:16+00', 'Vai a linda Dione furiosa;
');
	VALUES (704, 669, TIMESTAMP WITH TIME ZONE '2019-09-05 17:53:59+00', 'Por meio destes hórridos perigos,
');

	VALUES (705, 667, TIMESTAMP WITH TIME ZONE '2019-06-09 02:26:23+00', 'Já no campo de Ourique se assentava
');

	VALUES (706, 695, TIMESTAMP WITH TIME ZONE '2019-09-03 16:46:42+00', '"Muitos também do vulgo vil sem nome
');
	VALUES (706, 668, TIMESTAMP WITH TIME ZONE '2019-09-03 20:03:36+00', 'E não queirais louvores arrogantes
');
	VALUES (706, 695, TIMESTAMP WITH TIME ZONE '2019-09-03 23:09:48+00', 'Pelo trabalho, uns puxam pela amarra,
');
	VALUES (706, 668, TIMESTAMP WITH TIME ZONE '2019-09-03 23:25:18+00', 'Se vai ao Castelhano, prometendo
');

	VALUES (707, 668, TIMESTAMP WITH TIME ZONE '2021-02-27 21:58:39+00', 'Culpa de Reis, que às vezes a privados
');
	VALUES (707, 668, TIMESTAMP WITH TIME ZONE '2021-02-27 22:11:44+00', 'Por cima dos arneses: bravo estrago!
');

	VALUES (708, 669, TIMESTAMP WITH TIME ZONE '2018-12-27 23:28:41+00', 'Com danças e coreias, porque nelas
');
	VALUES (708, 669, TIMESTAMP WITH TIME ZONE '2018-12-28 03:06:42+00', 'Para detrás a forte nau forçando;
');

	VALUES (709, 671, TIMESTAMP WITH TIME ZONE '2019-09-21 06:16:58+00', 'Cortando vão as naus a larga via
');
	VALUES (709, 695, TIMESTAMP WITH TIME ZONE '2019-09-21 06:33:39+00', 'Tanto quanto convém, deles pretende
');
	VALUES (709, 671, TIMESTAMP WITH TIME ZONE '2019-09-21 12:26:18+00', 'E deles alcançando vencimentos
');

	VALUES (710, 671, TIMESTAMP WITH TIME ZONE '2018-09-06 10:50:19+00', 'Na terra que aos de Luso coube em sorte.
');

	VALUES (711, 680, TIMESTAMP WITH TIME ZONE '2018-10-25 08:58:22+00', 'Mas porém de pequenos animais
');
	VALUES (711, 680, TIMESTAMP WITH TIME ZONE '2018-10-25 09:30:50+00', 'Vê Catigão, cidade das milhores
');

	VALUES (712, 681, TIMESTAMP WITH TIME ZONE '2020-12-25 05:04:15+00', 'Pelos peitos as lanças lhe atravessa:
');
	VALUES (712, 681, TIMESTAMP WITH TIME ZONE '2020-12-25 09:52:28+00', 'Entre os Deuses, no Olimpo consagrado.
');
	VALUES (712, 681, TIMESTAMP WITH TIME ZONE '2020-12-25 10:40:06+00', 'Mudando, os fez um pouco afeiçoados.
');

	VALUES (713, 673, TIMESTAMP WITH TIME ZONE '2021-04-14 03:45:11+00', '"E se inda não ficarem deste jeito
');
	VALUES (713, 689, TIMESTAMP WITH TIME ZONE '2021-04-14 06:08:56+00', 'E que tanto fiou dum fraco pau
');
	VALUES (713, 673, TIMESTAMP WITH TIME ZONE '2021-04-14 06:22:33+00', 'Tirar à linda dama seus vestidos;
');
	VALUES (713, 673, TIMESTAMP WITH TIME ZONE '2021-04-14 10:10:15+00', 'Manuel, que exercita a suma alteza,
');

	VALUES (714, 673, TIMESTAMP WITH TIME ZONE '2021-05-19 01:41:19+00', 'Os ventos eram tais, que não puderam
');
	VALUES (714, 673, TIMESTAMP WITH TIME ZONE '2021-05-19 08:13:37+00', 'Destemperada e a voz enrouquecida,
');

	VALUES (715, 675, TIMESTAMP WITH TIME ZONE '2021-02-10 11:46:30+00', 'O grande Capitão, que o fado ordena
');
	VALUES (715, 675, TIMESTAMP WITH TIME ZONE '2021-02-10 16:24:21+00', 'Numa mão sempre a espada, e noutra a pena.
');

	VALUES (716, 675, TIMESTAMP WITH TIME ZONE '2021-04-29 11:04:49+00', 'Outras com os arcos de ouro se fingiam
');
	VALUES (716, 675, TIMESTAMP WITH TIME ZONE '2021-04-29 13:45:30+00', 'Do trabalho que encurta a breve idade.
');

	VALUES (717, 676, TIMESTAMP WITH TIME ZONE '2019-05-31 16:50:11+00', 'Cujo pomo contra o veneno urgente
');
	VALUES (717, 684, TIMESTAMP WITH TIME ZONE '2019-05-31 22:20:12+00', 'E tu nisto culpado por avaro.
');
	VALUES (717, 684, TIMESTAMP WITH TIME ZONE '2019-06-01 02:51:43+00', 'Nem quem sempre, com pouco experto peito,
');
	VALUES (717, 684, TIMESTAMP WITH TIME ZONE '2019-06-01 10:13:29+00', 'Num falso parecer mal entendido;
');

	VALUES (718, 691, TIMESTAMP WITH TIME ZONE '2021-03-21 09:27:42+00', 'O que eu sei que por mi vos será leve."--
');
	VALUES (718, 677, TIMESTAMP WITH TIME ZONE '2021-03-21 11:36:49+00', 'Muito mal dos estranhos compadece.
');
	VALUES (718, 691, TIMESTAMP WITH TIME ZONE '2021-03-21 19:35:46+00', 'Não pôde resistir à força dura
');
	VALUES (718, 677, TIMESTAMP WITH TIME ZONE '2021-03-21 23:23:21+00', 'Gil Fernandes é de Elvas quem o estraga,
');

	VALUES (719, 678, TIMESTAMP WITH TIME ZONE '2020-09-29 11:57:59+00', 'Secas do rosto as rosas, e perdida
');
	VALUES (719, 680, TIMESTAMP WITH TIME ZONE '2020-09-29 15:33:37+00', 'E consigo trará a formosa dama
');
	VALUES (719, 678, TIMESTAMP WITH TIME ZONE '2020-09-29 18:49:37+00', 'Que, porque no salgado mar nasceu,
');
	VALUES (719, 680, TIMESTAMP WITH TIME ZONE '2020-09-29 23:56:03+00', 'Faz do povo o furor por onde vinha;
');

	VALUES (720, 691, TIMESTAMP WITH TIME ZONE '2020-10-25 15:46:40+00', 'Basta, por fim do caso, que entendemos
');
	VALUES (720, 678, TIMESTAMP WITH TIME ZONE '2020-10-25 22:56:16+00', 'Ei-los subitamente se lançavam
');

	VALUES (721, 691, TIMESTAMP WITH TIME ZONE '2019-05-03 00:01:16+00', 'A quem lhe a dura nova estava dando,
');

	VALUES (722, 683, TIMESTAMP WITH TIME ZONE '2020-09-18 18:38:53+00', 'Os louvores da gente navegante,
');
	VALUES (722, 680, TIMESTAMP WITH TIME ZONE '2020-09-18 22:35:58+00', 'Pera o felice Gama assi dizia:
');
	VALUES (722, 683, TIMESTAMP WITH TIME ZONE '2020-09-19 05:40:32+00', 'Lhe diz como eram gentes roubadoras,
');
	VALUES (722, 680, TIMESTAMP WITH TIME ZONE '2020-09-19 13:35:40+00', 'Dos gritos, tocam a arma, ferve a gente,
');

	VALUES (723, 681, TIMESTAMP WITH TIME ZONE '2021-03-04 23:15:38+00', 'Não vedes que Pactolo e Hermo, rios,
');
	VALUES (723, 681, TIMESTAMP WITH TIME ZONE '2021-03-05 01:04:25+00', 'E como contra o Céu não valem mãos,
');
	VALUES (723, 681, TIMESTAMP WITH TIME ZONE '2021-03-05 06:59:55+00', 'Preso na Egípcia linda e nego pudica.
');
	VALUES (723, 681, TIMESTAMP WITH TIME ZONE '2021-03-05 13:09:21+00', 'Se enxerga da Dedálea facultade,
');

	VALUES (724, 695, TIMESTAMP WITH TIME ZONE '2019-09-05 13:13:17+00', 'Com que os teus Lusitanos favoreças.
');
	VALUES (724, 695, TIMESTAMP WITH TIME ZONE '2019-09-05 18:51:00+00', 'Do Turco oriental, e do Gentio,
');
	VALUES (724, 682, TIMESTAMP WITH TIME ZONE '2019-09-05 23:31:34+00', 'O cheiro traz perdido e a cor murchada:
');

	VALUES (725, 683, TIMESTAMP WITH TIME ZONE '2020-09-03 02:50:19+00', 'O curvo lenho e o férvido Oceano,
');
	VALUES (725, 683, TIMESTAMP WITH TIME ZONE '2020-09-03 09:32:24+00', 'Demos lugar ao nome Lusitano?
');
	VALUES (725, 683, TIMESTAMP WITH TIME ZONE '2020-09-03 09:50:15+00', 'Um de escudo embraçado e de azagaia,
');
	VALUES (725, 683, TIMESTAMP WITH TIME ZONE '2020-09-03 11:25:54+00', 'Afora as que possui soberanas
');

	VALUES (726, 685, TIMESTAMP WITH TIME ZONE '2021-02-11 02:03:30+00', 'Os Brâmenes o têm por cousa nova;
');
	VALUES (726, 685, TIMESTAMP WITH TIME ZONE '2021-02-11 08:28:13+00', 'Da terra chama Obi; entra em Quilmance.
');
	VALUES (726, 685, TIMESTAMP WITH TIME ZONE '2021-02-11 09:00:54+00', 'Não perderá seu preço, e sua valia.
');
	VALUES (726, 683, TIMESTAMP WITH TIME ZONE '2021-02-11 16:09:58+00', 'Como a razão e a ordem concertavam:
');

	VALUES (727, 684, TIMESTAMP WITH TIME ZONE '2018-11-19 00:11:13+00', 'A clara forma ali estava esculpida
');
